(4, 'Turma de Pesquisa em Ciência da Informação no período da tarde', 'Pesquisa para verificar o nível de interesse e disponibilidade em cursar Pesquisa em Ciência da Informação no turno da tarde.\r\nPor ser uma disciplina obrigatória do curso, é necessário verificar se existem alunos interessados em cursar essa disciplina no período da tarde ou não.\r\n\r\nDependendo da quantidade de alunos interessados essa turma no período da tarde poderá ser oferecida ou não.', '2019-05-02 17:05:59', 10, 1, 1),
(5, 'Estudo com os alunos egressos de Biblioteconomia (2008/2018)', 'Pesquisa com fins para descobrir situação profissional e acadêmica com os alunos egressos do curso de Biblioteconomia.', '2019-05-13 17:28:24', 14, 1, 1),
(6, 'Estudo com os alunos egressos de Arquivologia (2008/2018)', 'Pesquisa com fins para descobrir situação profissional e acadêmica com os alunos egressos do curso de Arquivologia.', '2019-05-31 13:32:20', 14, 3, 2),
(7, 'Alunos e os TCC', 'Alunos que vão fazer o TCC', '2019-06-27 18:45:56', 12, 1, 1),
(8, 'TESTE', 'TESTE', '2019-07-23 19:01:04', 6, 1, 1),
(9, 'TESTE 8 PERIODO', '...', '2019-09-19 17:00:44', 12, 1, 1),
(10, 'Cabam - Questionário Covid-19', '', '2020-05-20 20:00:48', 13, 1, 1),
(11, 'Cabam - Questionário Covid-19 (Biblioteconomia)', 'O Cabam e as Comgrads produziram um questionário a fim de conhecer as diferentes realidades do corpo discente das Ciências da Informação. Diferentes reuniões foram realizadas, sendo consenso em todas o quão imprescindível é entender como estamos e como queremos e podemos lidar no âmbito acadêmico em relação ao momento atípico e triste do nosso país.\r\n\r\nVocê pode acessar o formulário e compartilhá-lo com este link:\r\n\r\nHá identificação do Portal do Aluno para garantir a maior amostragem possível. Entraremos em contato individualmente com estudantes que não responderem ou que não tiveram acesso. \r\n\r\nAgradecemos a participação. Estamos à disposição nas redes sociais do Cabam e também por e-mail: cabam.ufrgs@gmail.com\r\n\r\nDesejamos que todes fiquem bem e segures.', '2020-05-21 23:17:44', 15, 1, 1),
(12, 'Cabam - Questionário Covid-19 (Museologia)', '', '2020-06-15 12:18:41', 15, 5, 3),
(13, 'Cabam - Questionário Covid-19 (Arquivologia)', '', '2020-06-15 14:12:31', 15, 3, 2);
INSERT INTO `campanha_questionario` (`id_qs`, `qs_campanha`, `qs_pergunta`, `qs_ordem`, `qs_query`) VALUES
(1, 3, 'Prezado(a) discente,\r\n\r\nIdentificamos no sistema que você está retido(a) no primeiro semestre da graduação. Portanto, nós da COMGRAD estamos lhe enviando este formulário com o objetivo de compreender essa retenção para podermos trabalhar juntos e superar essa situação, ajudando-o(a) a otimizar seu tempo de graduação. \r\n\r\nContamos com a sua colaboração no preenchimento do formulário e nos colocamos à disposição para qualquer dúvida.\r\n\r\nAtenciosamente,\r\n\r\nCOMGRAD Biblioteconomia', 2, '$M'),
(2, 3, 'Acompanhamento Discente - Biblioteconomia', 1, '$A2'),
(3, 3, 'Qual o grau da sua motivação para cursar Biblioteconomia antes de entrar no curso?', 10, '$R Nenhuma:Nenhuma&Pouca:Pouca&Média:Média&Muita:Muita&Totalmente Motivado:Totalmente Motivado'),
(4, 3, 'Qual o seu grau de motivação atual para cursar o curso de Biblioteconomia', 11, '$R Nenhuma:Nenhuma&Pouca:Pouca&Média:Média&Muita:Muita&Totalmente Motivado:Totalmente Motivado'),
(5, 3, 'Você já pensou em desistir do curso?', 15, '$R SIM:SIM&NÃO:NÃO'),
(6, 3, 'Quais as disciplinas do primeiro semestre você já cursou?', 20, '$CM História dos Registros Humanos:História dos Registros Humanos&Informação na Web:Informação na Web&Introdução a Sociologia:Instrodução a Sociologia&Introdução as Ciências da Informação:Introdução as Ciências da Informação&Leitura, Biblioteconomia e Inclusão Social:Leitura, Biblioteconomia e Inclusão Social'),
(7, 3, 'Quais dessas disciplinas você considera mais difícil?', 25, '$R História dos Registros Humanos:História dos Registros Humanos&Informação na Web:Informação na Web&Introdução a Sociologia:Instrodução a Sociologia&Introdução as Ciências da Informação:Introdução as Ciências da Informação&Leitura, Biblioteconomia e Inclusão Social:Leitura, Biblioteconomia e Inclusão Social'),
(8, 3, 'Quais dos motivos tiveram influência na sua retenção no primeiro semestre?', 30, '$CM Carga horário excessiva:Carga horário excessiva&Dificuldade de conciliar horários de disciplinas com outras atividades:Dificuldade de conciliar horários de disciplinas com outras atividades&Carga de leitura/estudos fora de sala de aula:Carga de leitura/estudos fora de sala de aula&Alguma disciplina específica:Alguma disciplina específica&Relação com colegas:Relação com colegas&Relação com professores(as):Relação com professores(as)&Conteúdo de disciplina(s):Conteúdo de disciplina(s)&Didática de professores(as):Didática de professores(as)&Falta de identificação pessoal com o curso e/ou profissão:Falta de identificação pessoal com o curso e/ou profissão&Problemas pessoais:Problemas pessoais'),
(9, 3, 'Desses motivos, qual teve principal influência?', 32, 'Carga horário excessiva:Carga horário excessiva&Dificuldade de conciliar horários de disciplinas com outras atividades:Dificuldade de conciliar horários de disciplinas com outras atividades&Carga de leitura/estudos fora de sala de aula:Carga de leitura/estudos fora de sala de aula&Alguma disciplina específica:Alguma disciplina específica&Relação com colegas:Relação com colegas&Relação com professores(as)Conteúdo de disciplina(s):Relação com professores(as)Conteúdo de disciplina(s)&Didática de professores(as):Didática de professores(as)&Falta de identificação pessoal com o curso e/ou profissão:Falta de identificação pessoal com o curso e/ou profissão'),
(10, 3, 'O que poderia ter lhe auxiliado a evitar a retenção no primeiro semestre?', 35, '$T80:5'),
(11, 3, 'Na sua opinião, como a COMGRAD poderia auxiliar nessa situação?', 36, '$T80:5'),
(12, 3, 'Esse é um espaço para você escrever sugestões/críticas/etc.', 37, '$T80:5'),
(14, 4, 'Qual o nível de disposição?', 20, '$R Eu irei cursar essa cadeira a tarde, caso ela seja disponibilizada.:Eu irei cursar essa cadeira a tarde, caso ela seja disponibilizada.&Tenho estágio a tarde, não poderei me inscrever.:Tenho estágio a tarde, não poderei me inscrever.&Não pretendo cursar essa cadeira semestre que vem.:Não pretendo cursar essa cadeira semestre que vem.'),
(15, 4, 'Prezadx alunx.\r\n\r\nEstamos começando a planejar as disciplinas para o próximo semestre e surgiu a possibilidade de abrirmos uma turma da disciplina de Pesquisa em Ciência da Informação no turno da tarde.\r\n\r\nPor ser uma disciplina obrigatória do curso, gostaríamos de verificar se existem alunos interessados em cursar essa disciplina no período da tarde ou não.\r\n\r\nDependendo da quantidade de alunos interessados essa turma no período da tarde poderá ser oferecida ou não.', 10, '$M'),
(16, 4, 'Qual o nível de interesse em cursar a cadeira de Pesquisa da Ciência da Informação no turno da tarde?', 20, '$R Tenho muito interesse.:Tenho muito interesse.&Tenho interesse.:Tenho interesse.&Tenho pouco interesse.:Tenho pouco interesse.&Não tenho interesse.:Não tenho interesse.'),
