(42, 10, 'Com a pandemia e as medidas de isolamento social, a relidade de alguns estudantes tenha sido alterada em relação à viabilidade de estudar no ambiente domiciliar, como você se encontra em relação ao estudo em EAD ou Hibrido?', 13, '$R Não tenho como estudar em casa e não é viável para mim ir até a Fabico:Não tenho como estudar em casa e não é viável para mim ir até a Fabico&Não tenho como estudar em casa, mas posso ir até a Fabico:Não tenho como estudar em casa, mas posso ir até a Fabico&Posso estudar em casa:Posso estudar em casa&Posso estudar no trabalho:Posso estudar no trabalho&Não tenho ou não sei o que pensar sobre o assunto:Não tenho ou não sei o que pensar sobre o assunto'),
