(100, 13, '<h2>COVID-19</h2>\r\n\r\nOlá! Esperamos que você, seus familiares e seus amigos estejam bem.\r\n\r\nUm dos pontos cruciais neste momento atípico é o entendimento das diversas realidades que os estudantes estão vivendo e vivem. Por isso, o Cabam e as Comgrads da Informação desenvolveram este questionário para uma avaliação inicial.\r\n\r\nNeste formulário, as respostas serão anônimas. O motivo da identificação do Portal do Aluno é garantir a maior amostragem possível. Entraremos em contato individualmente com estudantes que não responderem ou que não tiveram acesso. Você também tem espaço para escrever suas sugestões.\r\n\r\nAlgumas das possibilidades avaliadas no momento são a utilização do ensino remoto híbrido, com atividades à distância e presenciais, o que implicaria na abertura parcial da Fabico para estudantes que não possam realizar as atividades em casa. Apesar de termos chegado ao consenso, enquanto Departamento, que essa metodologia põe a segurança da comunidade fabicana em risco, queremos conhecer a opinião dos estudantes em relação a essas questões.\r\n\r\nO questionário dura entre cinco e dez minutos. Obrigada pela sua participação, compartilhe o link com seus colegas!\r\n\r\nCaso você tenha dúvidas específicas, nos mande um e-mail: cabam.ufrgs@gmail.com', 1, '$M');
