(1, 10, 3, '2017-10-22 12:55:56', '2017-11-03 11:30:36', 1, '', '', 'Totalmente Motivado', 'Muita', 'NÃO', 'Introdução a Sociologia;', '', 'Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'Eu passei na UFRGS e no curso técnico de Biblioteconomia (IFRS) ao mesmo tempo e resolvi fazer os dois, dando ênfase ao técnico por ser um período curto. Como a grade curricular de ambos é efetivada no período da manhã, acabou sendo criada essa situação de retenção no primeiro semestre - o que, creio, se resolverá a partir do próximo semestre, quando estarei fazendo estágio do curso técnico, mas este pode ser feito no período da tarde. Além disso, também tenho turnos em que estou trabalhando.', 'Não vejo como a COMGRAD auxiliar, uma vez que a situação depende mesmo da minha organização pessoal.', 'Só parabenizo a COMGRAD por essa busca de, em conjunto com o estudante, otimizar seu tempo de graduação.', '', '', '', '', '', '', '', ''),
(2, 14, 3, '2017-10-22 12:55:56', '2017-10-22 16:20:46', 1, '', '', 'Muita', 'Pouca', 'SIM', 'História dos Registros Humanos;Introdução a Sociologia;Leitura, Biblioteconomia e Inclusão Social;', 'Informação na Web', 'Carga de leitura/estudos fora de sala de aula;Alguma disciplina específica;Relação com colegas;Relação com professores(as);Didática de professores(as);Problemas pessoais;', '', 'Mais empatia dos professores com os alunos e menos soberba ao passar o conteúdo, aplicando-o à realidade dos alunos.', 'Revendo seu quadro de professores e considerando as opiniões dos alunos quanto à didática dos mesmos.', 'Tive problemas emocionais devido ao terrorismo que alguns professores aplicam em suas aulas, principalmente em relação a faltas. Em vez de acolher o aluno acabam o aterrorizando e o afastando do curso. Precisamos de professores motivadores e compreensivos com a indivialidade de cada um, em vez de recorrer a ameaças e linguagem vexatória em frente aos colegas na pretensão de exibir seu poder hierárquico na instituição.', '', '', '', '', '', '', '', ''),
(3, 345, 3, '2017-10-22 12:55:56', '2017-10-31 16:19:22', 1, '', '', 'Muita', 'Nenhuma', 'SIM', 'História dos Registros Humanos;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Introdução as Ciências da Informação', 'Falta de identificação pessoal com o curso e/ou profissão;', '', '', '', '', '', '', '', '', '', '', '', ''),
(4, 41, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(5, 47, 3, '2017-10-22 12:55:56', '2017-11-02 22:14:07', 1, '', '', 'Muita', 'Pouca', 'SIM', 'História dos Registros Humanos;Introdução as Ciências da Informação;', 'Informação na Web', 'Alguma disciplina específica;Relação com colegas;Conteúdo de disciplina(s);Didática de professores(as);', '', 'Acredito que o aluno deveria ter a opção de fazer seu trabalho individualmente e não ser obrigado a fazer trabalhos em grupo como é realizado em duas cadeiras logo do primeiro semestre. Já sou graduada em Letras e tentei pela segunda vez aproveitar Introdução à Sociologia e Leitura, Biblioteconomia e Inclusão, estou aguardando resposta. Já tentei aproveitar Informação na Web e inexplicavelmente não obtive resposta positiva.', 'Não vejo como auxiliar pois até agora não percebi a existência da COMGRAD.', 'O aluno deveria ser informado logo no início quanto ao Regime de Desempenho, eu não sabia e fiquei numa situação desconfortável. Se soubesse antes, teria pedido ajuda logo no começo. Não quero perder a minha vaga por isso.', '', '', '', '', '', '', '', ''),
(6, 50, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(7, 51, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(8, 350, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(9, 352, 3, '2017-10-22 12:55:56', '2017-10-22 20:54:20', 1, '', '', 'Muita', 'Muita', 'SIM', 'Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Informação na Web', 'Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'Trabalho em hospital, e em virtude disso meus horários são definidos semanalmente, fazendo com que em diversas oportunidades eu acabei perdendo as aulas do curso. Também tenho uma pessoa portadora de Mal de Alzheimer na minha família ( minha vó) que também preciso ajudar a cuidar, tornando cada vez mais difícil minhas idas a aula pois somos em duas pessoas pra cuidar dela. Eu e minha mãe e não podemos deixar minha vó sozinha em virtude do estágio em que a doença se encontra.', 'A Faculdade não tem culpa dos meus problemas pessoais. No tempo em que consegui frequentar as aulas, sempre todos foram muito solícitos. Espero no curto prazo conseguir retornar meus estudos.', '', '', '', '', '', '', '', '', ''),
(10, 135, 3, '2017-10-22 12:55:56', '2017-10-24 00:49:49', 1, '', '', 'Totalmente Motivado', 'Totalmente Motivado', 'NÃO', 'História dos Registros Humanos;Informação na Web;Introdução a Sociologia;Introdução as Ciências da Informação;', 'Leitura, Biblioteconomia e Inclusão Social', 'Alguma disciplina específica;', '', 'Atualmente estou cursando a disciplina de Leitura e inclusão social do primeiro semestre que havia ficado para trás por falta de disponibilidade de horário na terça feira pela manhã.', 'Ao final do atual semestre irei concluir a disciplina que falta para completar o primeiro semestre.', '', '', '', '', '', '', '', '', ''),
(11, 138, 3, '2017-10-22 12:55:56', '2017-10-23 00:50:10', 1, '', '', 'Média', 'Média', 'SIM', '', '', 'Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'O horário das disciplinas no turno da tarde.', 'Espero no próximo semestre conseguir realizar minha matrícula nas disciplinas e conciliar com meu horário de trabalho.', 'O horário das disciplinas pela manhã dificulta muito para mim, pois trabalho no turno da noite. Saio do trabalho pela manhã (as 7 horas) e vou estudar. Além disso, passei por problemas pessoais (saúde). Durante alguns semestres eu não consegui cursar, fazia a matrícula e depois o trancamento. Atualmente estou matriculado numa cadeira do 2 semestre (Metodologia), cursando regularmente e pretendo cursar as cadeiras do primeiro semestre em 2018. Mesmo com as dificuldades, sigo com o propósito de cursar as cadeiras do 1 semestre no ano que vem. Obrigado!', '', '', '', '', '', '', '', ''),
(12, 143, 3, '2017-10-22 12:55:56', '2017-10-24 08:21:56', 1, '', '', 'Média', 'Nenhuma', 'SIM', 'História dos Registros Humanos;Informação na Web;Introdução a Sociologia;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Introdução as Ciências da Informação', 'Relação com colegas;Conteúdo de disciplina(s);Falta de identificação pessoal com o curso e/ou profissão;Problemas pessoais;', '', 'Não sei direito', 'Não sei. Na verdade, não sei direito o que é a COMGRAD, já que ninguém nunca me explicou. eu sinto que estou flutuando avulso nesse curso.', 'Embora eu tenha problemas de depressão e ansiedade desencadeado por fatores externos ao curso, o curso me faz mal pois é uma engenharia da informação sem sentido nenhum além de atender demandas de mercado. Não é um curso que te dá orgulho, com o qual tu te identificas sabe. É só um motivo de piada, um amontoado de tarefas inúteis (conforme as palavras de uma certa professora). Não sei direito o que sugerir pois ainda não entendo como funciona a UFRGS (e pra ser sincero já nem me esforço mais pra entender)', '', '', '', '', '', '', '', ''),
(13, 148, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(14, 165, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(15, 354, 3, '2017-10-22 12:55:56', '2017-11-01 08:08:42', 1, '', '', 'Média', 'Média', 'SIM', 'História dos Registros Humanos;Informação na Web;Introdução a Sociologia;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Informação na Web', 'Alguma disciplina específica;Relação com colegas;Relação com professores(as);Didática de professores(as);Falta de identificação pessoal com o curso e/ou profissão;Problemas pessoais;', '', 'Bem.. Se minha irmã e meu pai não tivessem ficado internados, e ela não viesse a óbito eu teria conseguido concluir as disciplinas no início. Logo depois tive de trancar e ficar com minha família. Após esse período procurei ajuda do NAE mas nunca consegui vaga. Tenho uma seria dificuldade para apresentação de trabalhos, e por isso procurei ajuda psicológica e o NAE, iniciei tratamento e \"melhorou\" com remédios. Mas todos os fatores, e com professores que não se importam com tua dificuldade ou reprovam com FF quando esta em período de ocupação e as aulas mal ocorrem. Vai desanimando. Na Fabico parece tudo tão robotizado. Há professores que não parecem humanos.', 'Bem, sinceramente eu pensei quando recebi o e-mail \"nossa, que bom!!\" Pois eu só fui uma vez a COMGRAD, antes não ía pois a gestão passada passava mais \"medo\" do que ajuda. (Sem comentários..) Creio que a COMGRAD possa se por a disposição talvez assim por e-mail, informando os serviços que presta. Ou as dúvidas que podemos tirar, pois muita gente mal sabe para que serve, ou fica receosa como eu sempre fiquei. Pois o único contato sobre a COMGRAD que tive, foi no início do curso.', 'Queria agradecer o contato. Espero ter colaborado, que algo aconteça difetente para os próximos alunos em relação ao que destaquei. As vezes da medo até de expressar coisas do tipo, e é de muitos colegas. Que todos os setores pudessem se dispor mais assim, a compreender a situação do aluno e creio que talvez a COMGRAD em parceria com o NAE pudessem dar apoio a alunos como eu, pois não quero mais gastar dinheiro público dessa forma, mas não é facil sem apoio.', '', '', '', '', '', '', '', ''),
(16, 355, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(17, 166, 3, '2017-10-22 12:55:56', '2017-10-23 01:36:36', 1, '', '', 'Totalmente Motivado', 'Média', 'NÃO', 'História dos Registros Humanos;Informação na Web;Introdução a Sociologia;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Informação na Web', 'Falta de identificação pessoal com o curso e/ou profissão;Problemas pessoais;', '', 'Tenho depressão ansiosa diagnosticada e síndrome do pânico. Às dificuldades de cada dia são muitas e bem desconhecidas por muitas pessoas, inclusive no meio academico ocidental.', 'Estou tentando fazer transferência interna para museologia pois tenho gostado mais da carga horária relacionada a esse curso do que a do meu. Gostaria de ter mais informações sobre como resolver os meus problemas pessoais e conciliar com a faculdade.', 'O grande problema do meu dia a dia é que nunca sei como será levantar da cama. Se conseguirei. E acabei reprovando por FF muitas vezes, mesmo fazendo todos os trabalhos. Não faz sentido ter que ir ao meu psiquiatra buscar atestado sendo que o grande problema é sair de casa. Gostaria de saber também se posso trancar esse semestre enquanto espero pelo resultado da minha transferência interna. Att,\r\nJade Mendes', '', '', '', '', '', '', '', ''),
(18, 382, 3, '2017-10-22 12:55:56', '2017-10-23 10:29:22', 1, '', '', 'Muita', 'Nenhuma', 'SIM', 'Introdução a Sociologia;Introdução as Ciências da Informação;', 'Informação na Web', 'Falta de identificação pessoal com o curso e/ou profissão;', '', '', '', 'Eu não me matriculei nesse semestre em Biblioteconomia porque estou cursando administração agora na Ufrgs também.', '', '', '', '', '', '', '', ''),
(19, 383, 3, '2017-10-22 12:55:56', '2017-10-24 10:33:23', 1, '', '', 'Muita', 'Muita', 'NÃO', 'Informação na Web;Leitura, Biblioteconomia e Inclusão Social;', 'Introdução as Ciências da Informação', 'Alguma disciplina específica;Relação com professores(as);Didática de professores(as);Problemas pessoais;', '', 'Melhor organização pessoal do meu tempo de estudos.', 'A COMGRAD é bastante atuante, não tenho reclamações.', '', '', '', '', '', '', '', '', ''),
(20, 189, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(21, 204, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(22, 207, 3, '2017-10-22 12:55:56', '2017-10-23 09:42:09', 1, '', '', 'Muita', 'Pouca', 'SIM', 'História dos Registros Humanos;Informação na Web;Introdução a Sociologia;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Introdução a Sociologia', 'Relação com colegas;', '', 'Ter feito alguma amizade porque isso me atrapalha mesmo com a unica cadeira que eu faço agora.', 'Não acho que tenha como me ajudar a ser menos introvertida, mas obrigada por perguntar, mesmo parecendo por obrigação.', 'Como ter amigos > Pesquisar\r\n\r\nAAAAAAH SOCORRO\r\nEu não posso nem pensar nisso que eu já fico triste.', '', '', '', '', '', '', '', ''),
(23, 387, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(24, 214, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(25, 215, 3, '2017-10-22 12:55:56', '2017-10-22 15:26:14', 1, '', '', 'Muita', 'Média', 'SIM', 'História dos Registros Humanos;Informação na Web;Introdução as Ciências da Informação;Leitura, Biblioteconomia e Inclusão Social;', 'Informação na Web', 'Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'A culpa é toda minha. Estou com problemas pessoais.  Problemas familiares e financeiros q tem me tirado tempo e atenção.', '', '', '', '', '', '', '', '', '', ''),
(26, 361, 3, '2017-10-22 12:55:56', '2017-10-22 23:12:44', 1, '', '', 'Totalmente Motivado', 'Média', 'SIM', 'Informação na Web;Introdução as Ciências da Informação;', 'Introdução a Sociologia', 'Carga de leitura/estudos fora de sala de aula;Relação com colegas;Conteúdo de disciplina(s);Problemas pessoais;', '', 'Psicólogo  e  Psiquiatra gratuito pela UFRGS.', 'Pode me ajudar conseguindo um Psicólogo e Psiquiatra gratuito pra mim.', 'Eu ainda tenho interesse em continuar o curso, mas preciso de acompanhamento psicológico e psiquiátrico. Sinto muita ansiedade ao apresentar trabalhos e acabo desistindo. Não consigo me relacionar com os colegas e acabo esquecendo de fazer ou lembrar as datas de trabalhos. Sou muito dispersa durante as aulas. Tenho transtorno bipolar, 3 internações no hospital Espírita. Por favor , me ajudem, lutei muito pra entrar na UFRGS.', '', '', '', '', '', '', '', ''),
(27, 226, 3, '2017-10-22 12:55:56', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
