(31, 255, 3, '2017-10-22 12:55:56', '2017-11-07 02:16:42', 1, '', '', 'Muita', 'Média', 'SIM', 'Introdução a Sociologia;Leitura, Biblioteconomia e Inclusão Social;', 'Introdução as Ciências da Informação', 'Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'Acredito maior oferta de horários das cadeiras em outros turnos.', 'Deixando mais claro as opções em caso de problemas pessoais.', 'Perdi um ente querido no início do ano, não consegui cancelar as cadeiras do primeiro semestre de 2017-1. então acabei ficando com FF.', '', '', '', '', '', '', '', ''),
