(34, 403, 3, '2017-10-22 12:55:56', '2017-10-24 00:09:39', 1, '', '', 'Pouca', 'Muita', 'NÃO', '', 'Informação na Web', 'Carga horário excessiva;Dificuldade de conciliar horários de disciplinas com outras atividades;Problemas pessoais;', '', 'Minha avó não ter adoecido.', 'Acho que mandar esse questionário agora já é meio tarde pra qualquer coisa.', 'Provavelmente nunca mais terei sorte de entrar na ufrgs.\r\nAo menos minha falecida avó não verá que não cheguei a lugar algum.', '', '', '', '', '', '', '', ''),
