(183, 99, 5, '2019-05-22 18:07:24', '2019-05-22 15:21:48', 1, '', '2017', 'Não consegui colocação na área', 'Desemprego procurando primeiro emprego.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Acredito que uma mudança importante poderia ser feita no currículo do curso. Como uma das principais formas de ingresso na área é através de concurso público, senti falta de uma disciplina de legislação, pois tanto nosso código de ética, como as leis que regem nossa profissão e a do servidor público, são materiais densos de leitura, e necessários para a nossa profissão.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
