(190, 137, 5, '2019-05-22 18:07:24', '2019-05-22 17:25:22', 1, '', '2018', 'Me formei já empregado', 'Emprego formal dentro da área de Biblioteconomia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Embora, atualmente, eu esteja empregada no setor público, minha vaga não é efetiva. Trata-se de uma contratação por processo seletivo simplificado, cuja renovação se dá a cada doze meses, até que seja realizado um concurso público na área. Minha sugestão aos formandos é que apostem nesse tipo de contratação, mesmo que sejam temporárias. Claro que isso depende das circunstâncias de cada um (viabilidade econômica,familiar...) mas são oportunidades de aprendizado e experiência no mundo do trabalho, e dependendo da remuneração, dá pra fazer uma boa reserva de dinheiro.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
