(241, 439, 5, '2019-05-22 18:07:24', '2019-05-22 16:01:56', 1, '', '2017', 'Não consegui colocação na área', 'Emprego formal fora da área da Biblioteconomia, no setor privado com a carteira assinada', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Cursando pós-graduação (especialização).', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(242, 440, 5, '2019-05-22 18:07:24', '2019-05-22 17:59:18', 1, '', '2017', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', 'Trabalho em mais de um lugar no setor privado, todos com carteira assinada, porém poucas horas semanais.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(243, 443, 5, '2019-05-22 18:07:24', '2019-05-22 16:12:47', 1, '', '2017', 'Entre um e dois anos', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(244, 444, 5, '2019-05-22 18:07:24', '2019-05-22 15:39:58', 1, '', '2016', 'Não consegui colocação na área', 'Emprego formal dentro da área de Biblioteconomia, no setor público.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Trabalho como Técnico em Biblioteconomia no setor público, mas como Bibliotecário, ainda não consegui me inserir no mercado de trabalho atuando como tal. Participei de algumas entrevistas, e creio que não fui selecionado porque estava no setor público procurando emprego na área privada (alguns recrutadores não entendiam isso).\r\n\r\nGostaria muito de continuar meus estudos, estou aguardando algumas oportunidades ocorrerem.\r\n\r\nO curso de Biblioteconomia é bom, mas insuficiente diante das necessidades do mercado de trabalho. O curso tem que vir para o século XXI (ter mais cadeiras de Mkt, Informática (Big Data, Empreendedorismo), e as cadeiras de Biblioteca Escolar e Biblioteca Pública devem deixar de ser eletivas e voltar a ser obrigatórias. Abre muito mais concursos para essas duas áreas que para biblioteca universitária e, mesmo assim, o curso parece ter um perfil \"biblioteca universitária\".', '', '', '', '', '', '', '', '', '', '', '', '', ''),
