(261, 478, 5, '2019-05-22 18:07:25', '2019-05-24 07:26:08', 1, '', '2016', 'Não consegui colocação na área', 'Emprego formal fora da área da Biblioteconomia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Sou grata ao curso de Biblioteconomia e a todo corpo docente. Posso não trabalhar na área. Contudo, os conhecimentos adquiridos me auxiliam no trabalho. Já trabalhei no setor de compras e gestão de contratos como compradora e agora trabalho fazendo pesquisa de litispendência.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
