(272, 506, 5, '2019-05-22 18:07:25', '2019-09-13 08:40:32', 1, '', '2016', 'Não consegui colocação na área', 'Desempregado procurando emprego há menos de um ano.', 'Até 1 salário mínimo (R$ 998,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Estou ansioso para conseguir emprego fora da Biblioteconomia. Antes eu tinha muita vontade de ser bibliotecário. Mas infelizmente perto do final do curso é que finalmente percebi o óbvio: quase todos na área são de esquerda e eu não sou. Nos grupos de Biblioteconomia no Facebook apareciam com bastante frequência discussões de cunho político e ideológico e eu acabava manifestando pontos de vista discordantes.\r\nResultados: fui maltratado e hoje tenho séria aversão à Biblioteconomia e aos seus profissionais (em geral).\r\n\r\n“uma vez me disseram que quem dá moral a merda é mosca. Não vou debater contigo. Rs”\r\n“Oi?? Vc é bibliotecário?? Ai que vergonha...”\r\n“Vc que não sabe português teria que pagar para aprender, podendo então endireitar-se!”\r\n“Vai tem biblioteconomia social sim. Não tá satisfeito muda de profissão nossa área não merece conservadores como V.”\r\nEssas grosserias e indelicadezas foram dirigidas a mim e a outros colegas da Biblioteconomia que não comungam com as ideias esquerdistas, claramente predominantes entre os bibliotecários brasileiros. Essas declarações estão presentes em grupos e páginas de Biblioteconomia no Facebook.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
