(334, 616, 5, '2019-05-22 18:07:25', '2019-05-22 15:25:43', 1, '', '2014', 'Me formei já empregado', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Cursando pós-graduação (especialização).', 'Nas minhas respostas é necessário considerar que moro no interior, sempre morei, somente saí daqui para estudar. Por isso, quando me formei já tinha emprego, por não terem profissionais da área aqui e foi mais fácil. Além disso, atualmente abri meu negócio, mas continuo trabalhando 12 horas semanais em uma escola. Mas optei pela opção empregada com carteira assinada que acredito interessar mais vocês. Também a questão do salário fica mais abaixo porque vou menos horas, senão seria um salário bem justo.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
