(378, 693, 5, '2019-05-22 18:07:25', '2019-05-23 12:27:42', 1, '', '2014', 'Me formei já empregado', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Trabalho seis horas diárias e recebo um salário de R$ 2.300, 00. Faço tudo na biblioteca inclusive atender balcão. Faço \"bicos\" para complementar a renda não sobrando muito tempo para estudar, assim, nunca consegui alguma classificação satisfatória em concursos (quando existiam). Está bem difícil a vida aqui fora, vagas escassas e salários baixos. A Lei 12.244 chegou a dar esperança de melhora no mercado de trabalho até a descoberta de que as instituições estão mudando o nome de biblioteca para sala de leitura para fugir da obrigatoriedade de contratação do profissional bibliotecário. O que me mantém na área é o imenso amor pela Biblioteconomia.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
