(390, 710, 5, '2019-05-22 18:07:25', '2019-05-23 10:36:49', 1, '', '2013', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Precisamos de um piso salarial, só sugestões não nos ajudam em nada. Muitas bibliotecas com auxiliares pedagógicos tomando o lugar dos bibliotecários.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
