(395, 719, 5, '2019-05-22 18:07:25', '2019-05-22 15:35:06', 1, '', '2013', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(396, 720, 5, '2019-05-22 18:07:25', '2019-05-22 15:31:23', 1, '', '2013', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Talvez não seja o foco da pesquisa, mas gostaria de compartilhar algumas observações em relação ao mercado de trabalho na área, pois acho válido ressaltar que as ofertas de emprego para a biblioteconomia tem sido cada vez mais escassas.\r\nAcredito que tive uma ótima iniciação na área devido aos estágios que frequentei ao longo do curso e possuo uma renda salarial relativamente boa, mas vi muitos colegas/amigos por anos desempregados, assim como demorei mais de 1 ano para conseguir trocar de emprego. Na minha curta jornada, participei de diversas entrevistas em várias empresas, em especial IES, e as ofertas para a área eram muitas vezes vergonhosas (funções x salário). Quando encontrava uma oferta boa, a concorrência era realmente muito grande e muitos dos colegas de profissão que participavam das entrevistas já tinham anos de experiência, mas naquele momento estavam desempregados. Ao meu ver, o número de concursos públicos na área diminuiu também e, infelizmente, o cenário atual leva a crer que a situação tende a piorar. \r\n\r\nSe possível, gostaria de ver os resultados desta pesquisa. :)', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(397, 724, 5, '2019-05-22 18:07:25', '2019-05-22 15:57:22', 1, '', '2013', 'Entre 4 e 6 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
