(407, 740, 5, '2019-05-22 18:07:25', '2019-05-24 09:08:55', 1, '', '2013', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Agradeço a Universidade que me oportunizou um ensino de qualidade, permitindo que na minha primeira oportunidade de emprego eu fosse efetivada e pudesse colocar em prática todo conhecimento aprendido, percebendo desta forma o quanto o conteúdo do curso coaduna com a realidade profissional.\r\n\r\nMinha gratidão aos Professores da FABICO/UFRGS é eterna.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
