(415, 754, 5, '2019-05-22 18:07:25', '2019-05-22 16:43:30', 1, '', '2013', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Biblioteconomia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Cursando pós-graduação (especialização).', 'Dei sorte de haver um concurso com um número significavo de vagas logo após a minha colação de grau, e eu já estar me preparando há algum tempo. \r\nMas nos 8 meses entre a defesa do meu tcc e a nomeação em orgão público, mandei corriculo para absolutamente todas as vagas que abriram na área privada em porto alegre e região metropolitana. Foi chamada para apenas duas entrevistas, e nunca recebi resposta das mesmas.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
