(418, 758, 5, '2019-05-22 18:07:25', '2019-06-06 08:56:38', 1, '', '2013', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(419, 761, 5, '2019-05-22 18:07:25', '2019-05-23 10:25:40', 1, '', '2012', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Quando eu estava na faculdade ouvia que o mercado era amplo, que existia mais vagas do que profissionais formados mas na vida real a coisa é bem diferente, nas seleções que participo sempre ouço dos colegas como está cada vez mais difícil de conseguir uma vaga de bibliotecário e o quanto mal remunerado estamos. Para os recém formados a situação é pior pois a \"falta de experiência\" dificulta muito para eles, eu mesma só consegui meu primeiro emprego por que uma colega me indicou.\r\nAtt.\r\nCristiane Teixeira', '', '', '', '', '', '', '', '', '', '', '', '', ''),
