(472, 848, 5, '2019-05-22 18:07:25', '2019-05-24 09:11:21', 1, '', '2011', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Mestrado finalizado.', 'Apesar de eu estar empregada, posso dizer que nossa área está muuuuuuuuuuuiiiiiiiiiito dificil, tenho vários colegas desempregados, os salários estão muito baixos (já recebi anúncios de vagas com salários de R$1500,00) e as vagas muito escassas, eu só estou empregada, pq tenho um currículo muito bom, falo 3 idiomas, tenho mestrado e muito jogo de cintura, e tenho experiencia profissional de 15 anos , antes de me formar eu já trabalhava ... mas não trabalho perto de casa, como as vagas estavam difíceis depois que eu fui demitida do emprego anterior , aceitei trabalhar em uma cidade há 45 km de onde resido, e mesmo assim com redução de salário, no anterior eu ganhava 4500,00 há 2 anos atrás, hj ganho 3500,00 pagando 700,00 de gasolina ... é bom fazer esta observação , pois estar empregada , não quer dizer que estamos bem remunerados ... mas é bem legal esta iniciativa! parabéns!', '', '', '', '', '', '', '', '', '', '', '', '', ''),
