(524, 930, 5, '2019-05-22 18:07:25', '2019-05-22 19:47:44', 1, '', '2010', 'Me formei já empregado', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', 'Na época que me formei, as tecnologias para bibliotecas já estavam bem avançadas e hoje ainda mais. Eu tive de fazer cursos por fora da Faculdade para aprender o básico de programação, de sistemas para bibliotecas e infraestrutura de softwares. Acredito que, caso este tema ainda não seja muito forte na Faculdade, deva ser mais explorado. Em todos locais que trabalhei como bibliotecária (setor privado com carteira assinada) foi necessário eu saber um pouco de tecnologia para tomar as decisões sobre softwares da biblioteca. Estas qualidades inclusive foram essenciais para eu obter meu último emprego, no qual estou agora.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
