(630, 814, 5, '2019-05-22 18:07:26', '2019-05-23 15:47:33', 1, '', '2012', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Biblioteconomia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', 'Parabéns pela iniciativa. Ótimo e pertinente tema. Infelizmente ainda é muito tabu o assunto dentro da faculdade. Percebo que a realidade do mercado não acompanha o número de formandos a cada ano. Sou bibliotecária e acredito muito na importância e no impacto da minha profissão para a sociedade, mas infelizmente vejo essa realidade: o mercado não se interessa pela nossa mão de obra, e se pudessem escolher, escolheriam não nos contratar...', '', '', '', '', '', '', '', '', '', '', '', '', ''),
