(637, 25, 5, '2019-05-22 18:07:26', '2019-05-22 15:23:03', 1, '', '2018', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Biblioteconomia, no setor privado com a carteira de trabalho assinada.', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Estou empregada no setor privado, trabalhando na área de bibliotecas escolares, porém ainda estou procurando vaga em um local onde se valorize mais a profissão de bibliotecário e o salário seja melhor.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
