(648, 191, 5, '2019-05-22 18:07:26', '2019-05-22 15:27:32', 1, '', '2018', 'Não consegui colocação na área', 'Emprego formal fora da área da Biblioteconomia, no setor privado com a carteira assinada', 'Entre 1 a 2 salários mínimos (mais que R$998,00 até R$1.996,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Na questão \"Como está a sua situação profissional?\" Não encontrei a opção que se enquadra na minha situação, seria: Emprego formal fora da área da Biblioteconomia, no setor PRIVADO.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(649, 205, 5, '2019-05-22 18:07:26', '2019-05-22 19:23:27', 1, '', '2018', 'Me formei já empregado', 'Desempregado procurando emprego há menos de um ano.', 'Até 1 salário mínimo (R$ 998,00).', 'Cursando pós-graduação (especialização).', 'Acredito que na nossa área o emprego formal esta cada vez mais escasso, infelizmente. Quem tem seu emprego deve valorizar. Caso contrário, ficará desempregado que nem eu, pois tive que largar a oportunidade que tive por causa de problemas particulares e de horários. Quem tem interesse, pode trabalhar em casa como estou fazendo. É so divulgar  seu trabalho que sempre vai ter alguém interessado. Outra coisa importante é ter interesse em aprender mais que ABNT, pois o mercado exige da gente bem mais que isso. E se manter atualizado sempre.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(650, 213, 5, '2019-05-22 18:07:26', '2019-05-22 20:01:42', 1, '', '2018', 'Me formei já empregado', 'Emprego formal fora da área da Biblioteconomia, no setor público.', 'Entre 10 a 20 salários mínimos (mais R$9.980,00 até R$19.960,00).', 'Não pretendo mais estudar.', 'Faço trabalho voluntário na área de biblioteconomia, duas manhãs por semana. Era meu propósito com o curso.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
