(670, 198, 5, '2019-05-22 18:07:26', '2019-05-22 21:47:37', 1, '', '2019', 'Não consegui colocação na área', 'Desempregado procurando emprego há mais de um ano.', 'Até 1 salário mínimo (R$ 998,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'No momento estou buscando me profissionalizar em outra área fora da biblio e atuando como autônoma nessa nova área. Mas também tenho me candidatado para vagas de biblioteconomia quando surgem, pois mesmo como autônoma, minha renda é baixa.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
