(673, 279, 5, '2019-05-22 18:07:26', '2019-05-23 08:21:23', 1, '', '2019', 'Não consegui colocação na área', 'Emprego informal dentro da área de Biblioteconomia.', 'Até 1 salário mínimo (R$ 998,00).', 'Cursando pós-graduação (especialização).', 'Tentei responder de acordo com as respostas que se adequavam mais no meu contexto, mas a verdade é que me matriculei em outra graduação (Gestão em Recursos Humanos) na Uniasselvi, para continuar o estágio na Biblioteca que estagiava antes, me foi feita esta proposta pela empresa até a possibilidade de efetivação chegar em 2020. \r\nObrigada pela pesquisa com os ex alunos, é muito bom para a graduação enxergar como está o mercado.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
