(682, 1399, 6, '2019-05-31 20:07:57', '2019-06-04 12:37:06', 1, '', '2018', 'Me formei já empregado', 'Emprego informal dentro da área de Arquivologia.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Cursando pós-graduação (especialização).', 'O currículo do curso de Arquivologia está severamente atrasado e sob riscos graves de uma obsolescência que já se faz clara para o aluno recém formado. Porém, é possível agregar maior valor e transportar o currículo do século XX ao século XXI com pequenas mudanças, que na minha opinião são imprescindíveis para a carreira do profissional Arquivista. \r\n\r\nDito isto o profissional arquivista não é um profissional teórico, ele não é um trabalhador exclusivamente intelectual como é repetido incansavelmente, e equivocadamente, dentro do curso. Ele é um profissional laboral, ele é o administrador, o técnico, o gestor e o responsável pela logística que abrange suas funções.\r\nPrimeiramente, a cadeira [BIB03045] FUNDAMENTOS DE ARQUIVOLOGIA, deveria ser dividida em duas (de 4 créditos cada), uma abrangendo a história da disciplina, desde a sua criação, e a segunda atendo-se aos princípios da profissão e introduzindo o aluno aos primeiros passos de suas funções e algo das legislações que os regem.\r\n\r\nAs cadeiras do currículo de direito [DIR02204] INSTITUIÇÕES DE DIREITO e [DIR03017] DIREITO NOTARIAL, deveriam ser revistas, talvez até mesmo com a supressão da cadeira de direito notarial, que nada contribui para a formação do profissional arquivista, tendo em vista que o professor não consegue relacionar a carreira notarial com a carreira arquivistica.\r\n\r\nApós a cadeira [BIB03065] GESTÃO DOCUMENTAL EM ARQUIVOS, deveria ser ofertada uma cadeira de classificação documental, aos moldes da cadeira de avaliação, hoje a classificação e as demais funções do arquivista na parte de documentos correntes e intermediários é abordada superficialmente na cadeira de Gestão Documental. Porém, a discussão deve ser aprofundada para uma cadeira de classificação, capacitando ainda mais o aluno a lidar com esta documentação que, ao meu ver, é onde se concentra a maioria das ofertas de emprego no setor privado hoje em dia.\r\n\r\nA cadeira [BIB02016] INTRODUÇÃO À FOTOGRAFIA é excelente, fantástica, a cadeia mais divertida que pude fazer no curso, com uma teoria muito bem ministrada e uma prática agradável e de altíssimo nível, mas ela não serve de absolutamente nada para o profissional arquivista que não vá seguir estritamente a carreira da documentação fotográfica. Ela deveria ser uma cadeira eletiva, ajudaria na escassez de cadeiras eletivas no curso e abriria lugar no currículo duro/obrigatório para cadeiras que realmente são necessárias para a atualização da profissão.\r\n\r\nA cadeira [BIB03206] FUNDAMENTOS DA PRESERVAÇÃO DE DOCUMENTOS, deveria não só abranger os fundamentos da preservação de documentos, mas aprofundar-se no tema. Hoje o curso técnico de Biblioteconomia do Instituto Federal conta com duas cadeiras de preservação, uma teórica e outra prática. Este conhecimento é imprescindível para o profissional arquivista e hoje ele não é ofertado no curso.\r\n[BIB03205] REPROGRAFIA E MICROFILMAGEM deveria ser diminuída para 2 créditos ou renomeada para Reprografia, Microfilmagem e Digitalização e posta como cadeira eletiva. A criação de uma cadeira somente sobre digitalização para o currículo obrigatório também serviria para atualizar o curso em relação a esta nova demanda de mercado, que tem tudo para crescer e se tornar o carro chefe das ofertas no setor privado para arquivistas.\r\n\r\n [BIB03054] PROJETOS E SISTEMAS DE ARQUIVO deveria ser revista, é uma cadeira que é dada de forma somente teórica e sem aplicação incisiva nenhuma. Temas como custeio, pessoal, prazos, contratos e logística devem ser abordados de forma direta na cadeira, o profissional arquivista que tem o sonho ou a necessidade de trabalhar como profissional liberal precisa de uma base de projetos de arquivo importante.\r\nCriar uma disciplina de 2 créditos sobre Gestão de Projetos em Arquivos, ao final do curso, para que os alunos consigam ter uma visão geral e total de como elaborar um projeto de arquivo, utilizando-se dos conhecimentos aprendidos ao longo do curso.\r\n\r\nTambém é importante salientar que cadeiras como “Empreendedorismo”, “Introdução a Programação”, “Gestão de pessoas” (de equipes, ou algo relacionado a aspectos introdutórios de RH) e “Gerenciamento de projetos” (não só documentais) seriam de grande valor para a formação do profissional arquivista nesta nova era digital.', 'Gostaria de parabenizar aos envolvidos pela humildade em buscar com os egressos a melhora do curso. Quando o aluno se despede do curso ele (no meu caso) fica um tanto quanto orfão do ambiente que o acompanhou por 4, 5, 6 anos e é uma ruptura dolorosa, então esse tipo de atividade aproxima o ex aluno do curso e estimula o seu retorno, seja para pós graduação ou para algum outro curso no departamento. Então, ao parabeniza-los, tambem agradeço a lembrança e estou a disposição para eventuais dúvidas ou manifestações a certa da minha contribuição.\r\n\r\n\r\nAtt, Carlo Mazo Ferreira', '', '', '', '', '', '', '', '', '', '', '', ''),
