(690, 1409, 6, '2019-05-31 20:07:57', '2019-06-03 21:17:27', 1, '', '2018', 'Não consegui colocação na área', 'Emprego formal fora da área da Arquivologia, no setor público.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Acredito que a parte teórica é bem abordada, mas falta prática. Preparar o aluno para as situações reais no meio público e no privado, mas não apenas na guarda dos documentos e atividades afins, e sim colocá-lo como gestor dos acervos e de informações, praticar os diagnósticos, projetos e a atuação também como empreendedor.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
