(712, 1469, 6, '2019-05-31 20:07:57', '2019-07-02 00:07:06', 1, '', '2017', 'Me formei já empregado', 'Emprego formal fora da área da Arquivologia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Mestrado finalizado.', 'O curso é muito teórico e pouco prepara para o mercado de trabalho, os estágios é que salvam, ou não, dependo da supervisão e/ou instituição no qual o estágio é realizado. O problema não é o currículo e sim os programas das disciplinas e as formas de avaliação. Eu sugiro que dentro de cada disciplina exista um espaço para a parte prática, avaliações com exercícios práticos, mesmo que com material/documentos fictícios distribuídos durante as aulas, o que ocorre em pouquíssimas disciplinas.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
