(726, 1510, 6, '2019-05-31 20:07:57', '2019-06-03 12:53:43', 1, '', '2015', 'Entre um e dois anos', 'Emprego formal dentro da área de Arquivologia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Sim, entretanto acredito que as disciplinas obrigatórias poderiam ter mais aulas práticas, pois imagino que nem todos os alunos conseguem ter contato com as atividades de um arquivo (o estágio obrigatório ou não, nem sempre consegue atender isso), e talvez o curso passe um pouco a ideia de que o Arquivista é o profissional que só fica planejando e não tenha que ter contato direto com os documentos, o que não é verdade... Desde que entrei no curso tinha esta percepção, mas em meio a conversas com alguns estudantes e situações que presenciei, por exemplo, ser oferecido estágio na área para alguns e estes recusarem, percebi que nem todos visualizam desta forma.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(727, 1511, 6, '2019-05-31 20:07:57', '2019-06-03 21:44:29', 1, '', '2016', 'Não consegui colocação na área', 'Emprego informal fora da área de Arquivologia.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Pós-graduação (especialização) finalizada.', 'Acredito que o curso deva focar em documentos /arquivos digitais. Na graduação tive poucas cadeiras sobre o assunto e atualmente sou cobrada no mercado de trabalho.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
