(733, 1539, 6, '2019-05-31 20:07:57', '2019-06-03 12:59:26', 1, '', '2015', 'Entre 6 meses e um ano', 'Emprego formal dentro da área de Arquivologia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Pós-graduação (especialização) finalizada.', 'Sou egresso já há alguns anos, e estou um pouco desatualizado. Gostaria de colocar como sugestão para o currículo, que se pensasse na criação de uma cadeira, seja eletiva ou obrigatória, sobre empreendedorismo.\r\n\r\nGrato!', '', '', '', '', '', '', '', '', '', '', '', '', ''),
