(737, 1574, 6, '2019-05-31 20:07:57', '2019-06-03 14:43:01', 1, '', '2014', 'Não consegui colocação na área', 'Desemprego procurando primeiro emprego.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Considero desnecessárias tantas disciplinas eletivas.\r\nQuanto às obrigatórias, acredito que atendem bem às expectativas.', 'Seria interessante se o curso pudesse ter algum contato com as empresas para que conseguissem indicar seus alunos para um futuro emprego.', '', '', '', '', '', '', '', '', '', '', '', ''),
