(742, 1590, 6, '2019-05-31 20:07:57', '2019-06-04 11:06:00', 1, '', '2014', 'Entre 1 e 3 meses', 'Emprego formal dentro da área de Arquivologia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Pós-graduação (especialização) finalizada.', 'Para área privada o curso é muito fraco,  não prepara o profissional para o mercado de trabalho. No Currículo do curso falta  disciplinas obrigatórios e eletivas como:  segurança da informação, gestão de processos, gestão estratégica, Gestão de projetos, Fundamentos de transformação digital e preservação digital, Design Thinking e Inovação, Big Data, Modelos de negócio digitais, Estratégias de transformação digital,  psicologia empresarial, direito digital, Tecnologias emergentes, Marketing Digital, Difusão de arquivos digitais, Taxonomia e descrição digital. É necessário atualizar o o currículo de acordo com as mudanças, direito digital, novas tecnologias, estamos perdendo o mercado de trabalho para os profissionais de TI, Administração e gestão de processos.', 'As disciplinas do currículo como: Gerenciamento de documentos arquivísticos digitais,  Gestão documental, legislação arquivística, Avaliação documental, Fundamentos de preservação de documentos, Tópicos especiais em gestão de sistemas de informação era muito superficial e fraco os conteúdos e não contemplam os documentos nato digitais, transformação da sociedade ao acesso a informação e a tecnologias, de como elaborar e implementar projetos  de gestão documental, políticas arquivísticas, projetos de transformação digital,  sistemas de gerenciamento de documentos eletrônicos para área privada (gestão de processos e  o arquivo digital, assinatura digital).  As disciplinas de direito notarial, direito empresarial, psicologia social e estatística não tinha nada haver com o Curso de Arquivologia, visto que os conteúdos  não estavam interligados aos conteúdos do Curso de Arquivologia.  As disciplinas como Diplomática deveria contemplar os documentos nato digitais e de como realizar perícia forense em meio digital. Paleografia deveria ser uma disciplina eletiva. A disciplina de Arquivos especializados era muito fraca, não contemplava a legislação específica de cada arquivo especializado, ex: área da educação, médica, Recursos Humanos e outros...', '', '', '', '', '', '', '', '', '', '', '', ''),
