(751, 1608, 6, '2019-05-31 20:07:57', '2019-06-18 07:45:36', 1, '', '2013', 'Me formei já empregado', 'Emprego formal dentro da área de Arquivologia, no setor privado com a carteira de trabalho assinada.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Não pretendo mais estudar.', 'Como trabalho num arquivo central, então, as cadeiras relacionadas aos arquivos correntes e intermediários são fundamentais, ao longo da faculdade eu não tive nenhum experiência em arquivos permanentes, então, não são cadeiras que eu tenho um interesse mais profundo, mas acho importante para formação', '', '', '', '', '', '', '', '', '', '', '', '', ''),
