(770, 1645, 6, '2019-05-31 20:07:57', '2019-06-03 15:39:24', 1, '', '2011', 'Me formei já empregado', 'Emprego formal fora da área da Arquivologia, no setor privado com a carteira assinada', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Cursando pós-graduação (especialização).', 'Sobre o currículo do curso em si, não há questões há reclamar. O que realmente, senti falta, na época do curso, foi a realização de mais visitas em Arquivos Públicos / Privados no intuito de aliar Teoria e Prática.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
