(775, 1651, 6, '2019-05-31 20:07:57', '2019-06-03 13:28:32', 1, '', '2012', 'Entre 4 e 6 meses', 'Emprego formal dentro da área de Arquivologia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Não pretendo mais estudar.', 'Acho que para arquivos mais tradicionais, com documentos físicos, está adequado. Mas o mercado atualmente está mais direcionado e parece ter mais oportunidades (pelo menos na área privada) para quem tem habilidades na área de documentos e arquivos digitais. Lembro que as disciplinas que tive na área eram muito primárias, e os professores (2?) pouco didáticos.', 'Com relação ao curto período entre formatura e emprego, saliento que já vinha fazendo concursos desde a metade da graduação, tendo antecipado minha colação de grau por haver grande possibilidade de nomeação, o que ocorreu 3 meses depois.', '', '', '', '', '', '', '', '', '', '', '', ''),
