(779, 1656, 6, '2019-05-31 20:07:57', '2019-06-05 19:49:26', 1, '', '2012', 'Entre um e dois anos', 'Emprego formal dentro da área de Arquivologia, no setor público.', 'Entre 4 a 10 salários mínimos (mais que R$3.992,00 até R$9.980,00).', 'Mestrado finalizado.', 'Maior aprofundamento sobre o conteúdo das obrigatórias: gerenciamento de documentos digitais; Projetos e Sistemas de Arquivo, política e legislação arquivística, administração, diplomática, gestão documental, arranjo e descrição, preservação de documentos, direito. \r\nAs disciplinas de arquivos especializados e base de dados não necessitam ser obrigatórias.', 'A maioria das instituições públicas não investe nos arquivos e por essa razão, o arquivista ao assumir suas funções se depara com m.d.a., bem como, sistemas obsoletos armazenados nos servidores, sistemas de negócio que não atendem aos requisitos do e-Arq Brasil. Assim, precisa possuir sólidos conhecimentos para enfrentar grandes desafios, pois o processo é lento em virtude da cultura organizacional. É fundamental, portanto, conhecimento sobre legislação arquivística, funções arquivísticas, diplomática, direito administrativo, administração (planejamento, organização e métodos, projetos), mapeamento e modelagem de processos com o uso da ferramenta Bizagi, documentos nato digitais e digitalizados, uso do SIGAD, RDC-Arq e Plataforma de Acesso, com a finalidade de implantar política arquivística, de preservação, programa de gestão de documentos, elaborar projetos, planos e sistema de arquivos.', '', '', '', '', '', '', '', '', '', '', '', ''),
