(797, 1719, 6, '2019-05-31 20:07:57', '2019-06-04 14:31:43', 1, '', '2009', 'Acima de dois anos', 'Emprego formal dentro da área de Arquivologia, no setor público.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Em relação ao atual currículo, que difere um pouco do cursado por mim, creio que está mais de acordo com as necessidades encontradas no mercado. Percebi que houve acréscimo de disciplinas de ética e direitos humanos e documentos digitais, que são abordagens importantes. Creio que poderia ser dada mais ênfase à gestão de pessoas, algo de prática (fora dos estágios obrigatórios) e menos ênfase talvez de reprografia e microfilmagem que ocupam hj 4 créditos, e maior em Políticas e Legislação. As disciplinas raíz (gestão, avaliação e arranjo) merecem mais atenção, ao menos pela minha experiência com o meu currículo.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
