(801, 1729, 6, '2019-05-31 20:07:57', '2019-06-09 19:23:24', 1, '', '2008', 'Não consegui colocação na área', 'Emprego formal fora da área da Arquivologia, no setor público.', 'Entre 2 a 4 salários mínimos (mais que R$1.996,00 até R$3.992,00).', 'Gostaria/tenho interesse em aumentar meu nível de graduação.', 'Quando me formei, em 2008, estava adequado, não sei como está agora... Se ainda faz parte do curso a disciplina de contabilidade, acredito que teria que ser mais particularizado para o curso, como por exemplo conhecimento dos diversos tipos de notas e documentos e prazo para guarda.', 'Eu ainda não desisti de exercer minha profissão, no setor público que trabalho estou tentando trabalhar no arquivo que ainda não existe oficialmente.', '', '', '', '', '', '', '', '', '', '', '', ''),
