(803, 1735, 6, '2019-05-31 20:07:57', '2019-06-03 12:32:38', 1, '', '', 'Me formei já empregado', 'Emprego formal fora da área da Biblioteconomia, no setor público.', 'Entre 10 a 20 salários mínimos (mais R$9.980,00 até R$19.960,00).', 'Não pretendo mais estudar.', 'Considero de acordo.', 'Eu me formei em 2008/2. Trabalhei 8 anos em arquivo, no mesmo local, desde o 2º semestre do curso. A falta de interesse da administração em valorizar minimamente o setor me conduziu a buscar outra ocupação. Desde dez/2013 abandonei a área de Arquivologia.', '', '', '', '', '', '', '', '', '', '', '', ''),
