(836, 57, 7, '2019-06-27 18:46:24', '2019-06-29 14:06:45', 1, '', 'Ainda não tenho projeto.', 'Não comecei a elaboração.', 'Estou a procura.', 'Não há previsão de quando irá apresentar.', 'Meu nome é Berenice Zigunov Guilhermano (00210284), cursei a disciplina de Projeto de Pesquisa com a professora Sônia em 2016-02. Nela elaborei um projeto a ser orientado pela professora Rita Laipelt e que seria  desenvolvido no Hospital da Criança Santo Antônio junto aos pacientes, familiares e equipe médica. Já havia escrito um artigo sobre o uso de siglas e abreviaturas na disciplina da professora Rita Laipelt na disciplina de Introdução a Terminologia em 2016-01 com esta temática do projeto. Como o andamento deste projeto esbarrou no conselho de ética do hospital e na época faltava-me eletivas e complementares para seguir no curso, fui cursando eletivas a noite para completar esta carga horária (atual momento). Neste semestre, além de duas eletivas - uma em EAD e outra presencial,  estou prestando serviço de monitora para professora Maria do Rocio. Encontro-me num dilema acerca de como elaborar um novo projeto ou dar continuidade aquele inicial porém abordando como um estudo de caso. Uma outra possibilidade seria entrar em contato com a professora Eliane Moro e ver aplicabilidade deste viés temático no Projeto Coragem que ela desenvolve no Hospital de Clínicas com pacientes com fibrose cística. Ainda faltam-me alguns créditos complementares advindos de um novo tipo de atividade além da monitoria e meu prazo para formar-me esgota-se em 2021-02. Porém trabalho atualmente 9 hs por dia numa loja de fotos em Canoas e até o ano que vem pretendo pensar melhor sobre qual melhor momento para desligar-me da empresa e finalizar o curso de Biblioteconomia.', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
