(919, 22, 11, '2020-06-09 12:58:38', '2020-06-10 16:27:31', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Além da questão dos discentes que não tem acesso aos equipamentos e recursos necessários, é necessário pensar se é os docentes estão preparados para desenvolver as atividades à distância de maneira que não comprometa a qualidade do ensino. Levando tudo isso em consideração e, tendo em mente que é preciso dar continuidade as atividades acadêmicas de alguma forma, acredito que a realização de atividades complementares e eletivas pode ser uma medida efetiva, pois não afeta os alunos que não terão como participar destas atividades.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
