(924, 101, 11, '2020-06-09 12:58:38', '2020-06-10 15:25:07', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Acho válido para algumas disciplinas, porém no meu caso não adianta porque sou formanda e ainda preciso realizar o estágio obrigatório. Logo, a disciplina de seminário de estágio, que é a que eu estaria cursando, fica inviável de ser concluída.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(925, 108, 11, '2020-06-09 12:58:38', '2020-06-11 15:14:18', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Há pontos positivos e negativos. Mesmo com acesso à internet e espaço adequado para estudos em casa, eu tive uma produtividade baixíssima quanto ao meu tcc nos ultimos meses. A situação em que nos encontramos de forma mundial, mas especialmente como brasileiros, é alarmante. Isso traz impactos gigantescos para a saúde mental de qualquer pessoa.', 'Sim', 'Nenhuma', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(926, 110, 11, '2020-06-09 12:58:38', '2020-06-19 07:07:28', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Não acho adequado, porém é necessário.', 'Sim', 'Ensino à distância assíncrono', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Sim', '', '', '', ''),
(927, 122, 11, '2020-06-09 12:58:38', '2020-06-10 15:05:40', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Ótimo, pois já estou no 8 semestre e tenho uma eletiva de 3 créditos p acabar.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Ótima pesquisa e q seja o melhor p todos.', '', '', ''),
(928, 5, 11, '2020-06-09 12:58:59', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(929, 8, 11, '2020-06-09 12:58:59', '2020-06-15 11:54:31', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Infelizmente sabemos que o acesso a internet está relacionado ao bairro e condições de cada família. Todos passamos por um momento delicado. A minha situação em particular permite que eu continue os estudos remotamente já que tenho acesso a internet e tenho computador, mas me solidarizo com os alunos que não possuem essa condição e por isso acredito que não será justo voltar aos estudos, visto que as oportunidades não serão iguais para todos. Portanto, sou contra.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(930, 20, 11, '2020-06-09 12:58:59', '2020-06-17 20:04:41', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e medianamente estável', 'Sou contra o retorno imediato. Esse primeiro semestre letivo deve ser cancelado; o segundo semestre do ano deve ser considerado como primeiro do ano, e se os professores prestarem bom atendimento virtual aos alunos estou de acordo com atividades remotas (se deve considerar que alguns alunos, como no meu caso, estão no final no curso, etapa a qual é fundamental a orientação adequada de orientadores e interação com colegas). Também cabe levantar um ponto, no final do curso de Biblioteconomia, é necessário realização de estágio obrigatório, grande parte dos alunos, em virtude da atual situação, não tem como realizar tais estágios, como isso ficará?', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Pesquisa relevante. Essa pandemia é um caso totalmente atípico, logo espero que a melhor medida seja tomada visando o bem de todos.', '', '', ''),
(931, 46, 11, '2020-06-09 12:58:59', '2020-06-19 12:21:31', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Outro', 'Celular e computador', 'Média', 'Menos de 10 megas e pouco estável', 'Sou contra principalmente pela precariedade da minha internet e da maioria dos alunos também que nem internet possuem.', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras descartáveis', 'Não', '', '', '', ''),
(932, 51, 11, '2020-06-09 12:58:59', '2020-06-11 11:44:01', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Contanto que os alunos que não tenham como acompanhar o semestre de forma remota não sejam prejudicados, eu não vejo problemas', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(933, 54, 11, '2020-06-09 12:58:59', '2020-06-10 20:53:19', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Não é uma boa opção, pois nem todos os alunos possuem internet e computador em casa, o que geraria uma desigualdade no ensino e colocaria a vida e a saúde dos alunos que precisassem ir até a Fabico utilizar os laboratórios de informática em risco.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(934, 57, 11, '2020-06-09 12:58:59', '2020-06-10 16:36:53', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Computador (notebook)', 'Média', 'Mais de 10 megas e medianamente estável', 'Acredito que dependendo da fase acadêmica em que o aluno se encontre é possível acompanhar as aulas deste semestre que está findando em EAD sem um comprometimento maior com relação ao aproveitamento.\r\nSeria necessário levar em conta ainda o grau de acesso a internet que este aluno teria (constância e velocidade) e suas habilidades em navegar na plataforma Moodle.\r\nNo meu caso, sou aluna de Biblioteconomia cursando o sexto semestre e estou matriculada presencialmente em 2020-01 numa disciplina eletiva (ia assistir aula uma noite por semana na Fabico). Eu teria como acompanhar esta disciplina em EAD por já ter cursado outras anteriormente neste formato, precisaria ela ser estruturada para ser aplicada a distância.', 'Sim', 'Ensino à distância assíncrono', 'Trem', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(935, 59, 11, '2020-06-09 12:58:59', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(936, 63, 11, '2020-06-09 12:58:59', '2020-06-13 13:14:44', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Acho que é a melhor saída para a crise atual, porém sei que não são todos os alunos que tem condições de acompanhar.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(937, 87, 11, '2020-06-09 12:58:59', '2020-06-19 12:43:05', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'eu prefiro ter aula a distância pois eu moro longe, tenho que pegar dois ônibus assim eu corro risco de pegar o vírus.', 'Não', 'Ensino à distância por videoconferência ao vivo', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(938, 88, 11, '2020-06-09 12:58:59', '2020-06-10 15:16:35', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', '', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(939, 91, 11, '2020-06-09 12:58:59', '2020-06-11 15:49:39', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Acho uma maneira possível para a retomada das atividades.', 'Não', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(940, 98, 11, '2020-06-09 12:58:59', '2020-06-11 19:40:23', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Sou contra, pois nem todos os estudantes têm acesso aos recursos ou se sentem confortáveis usando-os.', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras descartáveis', 'Não', '', '', '', ''),
(941, 115, 11, '2020-06-09 12:58:59', '2020-06-12 18:28:24', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e pouco estável', 'Acho pouco responsável que seja cogitada a possibilidade de ensino à distância justamente no momento em que o país bate recorde de mortes e contágio. Acho que nem todas as pessoas terão as mesmas condições e o aprendizado será prejudicado. Acho que não basta pensar apenas em acesso à internet, mas também em todas as outras questões que envolvem o processo de aprendizado. A pessoa precisa de um local pra poder estudar, de silêncio, e em um momento em que muitas pessoas estão confinadas com a família inteira dentro de casa em tempo integral é meio óbvio que muitos estudantes não terão isso. A pessoa pode ter acesso à internet, espaço, silêncio, mas simplesmente não ter condições psicológicas para conseguir, nesse momento, se concentrar e absorver os conteúdos de forma satisfatória. \r\nMais uma vez, acho uma enorme irresponsabilidade e acho que não é o momento de preocupação com semestre, ou ano letivo, que seja. Eu mesma me formaria nesse ano, não perdi nenhuma disciplina, me esforcei para me formar nós 4 anos regulares do curso. É provável que isso não seja mais possível, e está tudo bem, porque as prioridades em um momento como esse não podem permanecer as mesmas.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Na questão sobre saúde mental há as opções Sim, Não, Discorra. Ao selecionar discorra não abre uma caixa de texto para que o assunto seja comentado, então, vou comentar aqui:\r\nGente, pelo amor de deus: QUEM É QUE NÃO ESTÁ PSICOLOGICAMENTE ABALADO NESSE MOMENTO? Todo dia é uma derrota diferente, o país sem liderança alguma, a situação em vez de se tornar mais amena fica a cada dia mais caótica. As pessoas não tem a mínima consciência de coletividade e saem por aí como se estivesse tudo bem. Pelo menos a comunidade acadêmica tem de ter bom senso nesse momento e entender que às vezes uma pessoa está com o psicológico totalmente abalado e nem se dá conta disso.\r\nParticularmente falando, eu já tive crise de ansiedade, desenvolvi psoríase, que é totalmente relacionada ao sistema nervoso e a cada dia que passa estou mais próxima de gastar meu réu primário sentando a mão no primeiro eleitor do Bolsonaro que vier dizer que é só uma gripe e que precisa cuidar da economia.  Gente, dane-se a economia. Dane-se o semestre. É hora de cuidar das pessoas. Eu não sei como explicar que vocês deveriam se preocupar com as PESSOAS.', '', '', ''),
