(946, 39, 11, '2020-06-09 12:59:10', '2020-06-17 14:44:18', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acho uma possibilidade viável, desde que as atividades remotas sejam assíncronas, o que permitiria maior flexibilidade e adaptação.', 'Sim', 'Ensino à distância assíncrono', 'Carro próprio', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(947, 40, 11, '2020-06-09 12:59:10', '2020-06-10 22:59:21', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Alta', 'Menos de 10 megas e medianamente estável', 'Sou a favor do uso de recursos, desde que estejam acessíveis a todos os alunos.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Gostaria de informar que sou do grupo de risco e moro com pessoas que pertencem a esse grupo. Tenho filhos em idade escolar que necessitam do meu auxilio, pois estão tendo aulas em Ead. Também precisamos dividir o mesmo computador. Outro problema que ocorre é o de locomoção visto que os horários dos ônibus foram reduzidos.Sei que todos estão agindo com equidade para o bem de todos. Obrigada, abraços e força!', '', '', ''),
