(1005, 1139, 11, '2020-06-10 17:56:56', '2020-06-15 13:35:52', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acredito que mentalmente devido a pandemia,pode afetar um pouco o desempenho nas aulas em Ead.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1006, 17, 11, '2020-06-10 17:57:08', '2020-06-15 09:52:35', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Vejo como parte de um programa de governo que sempre incentivou o desmonte da educação pública; dar esse espaço ao EaD (ou ERE) é abrir uma janela para as privatizações que sempre foram o objetivo da atual gestão do MEC. Além disso, não posso deixar de considerar que temos muitos colegas que não poderiam acessar as aulas, ou teriam um semestre meio capenga mesmo tendo acesso, e essa desigualdade de participação e consequente exclusão de estudantes não devia ser algo simplesmente aceito entre nós. Considero como nosso compromisso defender a universidade pública e acessível a todos!', 'Sim', 'Nenhuma', 'Bicicleta', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1007, 52, 11, '2020-06-10 17:57:08', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1008, 1135, 11, '2020-06-10 17:57:08', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1009, 61, 11, '2020-06-10 17:57:08', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1010, 86, 11, '2020-06-10 17:57:08', '2020-06-28 17:49:45', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Baixa', 'Mais de 10 megas e pouco estável', 'Eu não concordo. Nem todas as disciplinas poderiam ser ministradas de forma satisfatória à distância. Haveria uma quantidade de dificuldades que o aluno enfrentaria para compreender conteúdos complexos. Estou no final do meu curso, portanto as disciplinas que preciso cursar são avançadas e complexas, o que torna fundamental a interação com o professor. Há também algumas disciplinas que necessitam atividades práticas, pois meu curso é bastante técnico. Seria impossível aprender determinados conhecimentos sem a presença física em ambientes especializados.\r\n\r\nTambém ressalto com muita importância que meu computador já é bastante antigo para acessar determinadas tecnologias. Eu poderia não conseguir acompanhar em casa as dinâmicas on-line propostas. E ir à Fabico para acessar os laboratórios poderia me expor ao contágio com o Covid, o que não pretendo fazer de forma alguma.\r\n\r\nSou totalmente contrária ao ERE devido às dificuldades que não somente eu, mas uma porcentagem significativa dos estudantes da universidade enfrentarão. A pandemia tem deixado todos com níveis de estresse alto. Eu, particularmente, possuo Transtorno de Ansiedade Generalizada (CID 10 - F41.1) e Fibromialgia (CID 10 - M79.7), doenças que têm seus sintomas piorados em situações de alto estresse. Logo, não me sinto saudável neste momento para prosseguir normalmente com os estudos da minha graduação. Meu aprendizado poderia ser comprometido, o que poderia acarretar prejuízos na minha atuação profissional posterior. Sou a favor de que o retorno às aulas se dê somente quando houver uma vacina e todos possam ter sua saúde mental recuperada.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1011, 97, 11, '2020-06-10 17:57:08', '2020-06-15 17:40:06', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Acho interessante no sentido de que é a única forma de evitar contato físico/presencial que possa dar continuidade as atividades, no entanto me preocupo com o pessoal que não tem acesso a internet em casa ou não tem os meios necessários para uma aula EAD plena.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1012, 105, 11, '2020-06-10 17:57:08', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1013, 107, 11, '2020-06-10 17:57:08', '2020-06-19 15:14:26', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Penso que tenho disponibilidade para acessar a internet em casa mas me preocupo com os alunos que não possuem acesso.', 'Sim', 'Ensino à distância assíncrono', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1014, 1138, 11, '2020-06-10 17:57:08', '2020-06-15 20:08:52', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acredito que seja uma medida viável caso todos tenham acesso a mesma forma de ensino.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1015, 117, 11, '2020-06-10 17:57:08', '2020-06-15 09:30:14', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Média', 'Menos de 10 megas e medianamente estável', 'Não acredito que seja eficaz.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
