(1017, 1785, 11, '2020-06-15 12:12:01', '2020-06-15 20:30:04', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Baixa', 'Mais de 10 megas e medianamente estável', 'Desaconselhável', 'Sim', 'Nenhuma', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras descartáveis', 'Sim', '', '', '', ''),
(1018, 126, 11, '2020-06-15 12:12:01', '2020-06-16 18:33:08', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e medianamente estável', 'Acho complicado, pois não possuo web câmera (não sei se seria utilizado este recurso pelo celular, não estou familiarizado), e não me sentiria à vontade em uma aula via vídeo conferência, embora não signifique eu não tentaria realizar este tipo de atividade, mas só em último caso, por exemplo se houver outra alternativa.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Minha sugestão é de atividades de ensino à distância assíncrono, porém com os computadores da Universidade disponíveis em turno integral para quem não possuir meios de realizar as atividade em suas casas, possibilitando a realização das atividades nos laboratórios de informática da Universidade. O problema seria possíveis aglomerações nos laboratórios, além da questão de deslocamento, que seria a mais problemática devido às aglomerações nos transportes públicos. Sou bolsista e de vez em quando preciso ir até a Universidade para realizar meu trabalho, quando é algo que não é possível de fazer via home office, e parte mais complicada é sempre o transporte público.', '', '', ''),
(1019, 129, 11, '2020-06-15 12:12:01', '2020-06-19 15:01:45', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1020, 130, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1021, 1210, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
