(1023, 131, 11, '2020-06-15 12:12:01', '2020-06-15 12:41:22', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', '', 'Não', 'Ensino à distância por videoconferência ao vivo', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1024, 132, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1025, 1831, 11, '2020-06-15 12:12:01', '2020-06-15 18:00:25', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Mais de 10 megas e medianamente estável', 'Todos tendo acesso acho que seja necessário já que na atual conjuntura será o único meio de dar segmento ao semestre.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1026, 135, 11, '2020-06-15 12:12:01', '2020-06-16 23:19:52', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acredito que esta seja a unica forma de prosseguir com o semestre, considerando que a retomada das aulas presenciais esta longe de acontecer diante da situação em que o país se encontra. Sendo necessário realizar um levantamento dos alunos que não poderiam acessar a internet e adotar medidas alternativas.', 'Sim', 'Ensino à distância assíncrono', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '- O ambiente virtual é a unica opção viável para retomada das atividades (é necessário agilizar a adequação das aulas para este formato o quanto antes). \r\n\r\n- Caso as aulas sejam retomadas presencialmente, teria que trancar. Pois para deslocamento é necessário 1h dentro do trem, mais o onibus (lotados/ambiente favorável a propagação do covid-19). Também por fazer parte do grupo de risco (bronquite) e residir com meus pais (idosos e com problemas de saúde tais como hipertensão).\r\n\r\n- É preciso desenvolver alguma estratégia viável para aqueles que não tem acesso a internet consigam acompanhar as atividades EAD.', '', '', ''),
(1027, 1176, 11, '2020-06-15 12:12:01', '2020-06-15 09:39:42', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Devido a situação atípica que estamos vivendo, acredito que possa ser uma das saídas para dar continuidade ao semestre, mas temo que as atividades fiquem sobrecarregadas, visto que já estou realizando estágio EAD e me sinto cansada por passar horas em frente do computador.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1028, 138, 11, '2020-06-15 12:12:01', '2020-06-18 06:45:25', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Estou de acordo, não terei problemas.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Particularmente, tenho condições de acompanhar as aulas no modo ERE. No entanto, sou solidário à maioria dos estudantes que não podem e entendo perfeitamente a situação.', '', '', ''),
(1029, 142, 11, '2020-06-15 12:12:01', '2020-06-15 13:55:14', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'acho q tudo precisar ser muito bem avaliado pra q todos tenham acesso, o q já está sendo feito nesse questionario e em q situação o aluno se encontra em casa, se ele consegue ter seu espaço e tempo para conseguir assistir aulas e realizar tarefas já que com essa situação muitas pessoas estão fazendo quarentena com familiares', 'Sim', 'Ensino à distância assíncrono', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'acho importante saber se a aprendizagem desse modo realmente acontecerá levando em consideração que algumas disciplinas são difíceis até presencialmente e já precisam de uma demanda grande de esforço  do aluno e a presença semanal do professor é fundamental pra isso, analisar bem se as atividades vão voltar e os alunos vão aprender e evoluir ou vão voltar pra contar aula dada.', '', '', ''),
(1030, 144, 11, '2020-06-15 12:12:01', '2020-06-21 11:06:28', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Computador (notebook)', 'Média', 'Menos de 10 megas e muito estável', 'Não vejo como algo que inclui todos os alunos.\r\nExistem diferentes problemas na hora de tentar esse tipo de recurso, eu até não tenho muitos problemas além dos causados pelo aborrecimento de estar em quarentena e uma internet meia boca.\r\nCreio que nesse momento várias pessoas podem perder familiares e pessoas querida, acho que não será muito saudável retornar, mas além disso existe a exclusão de pessoas sem os recursos necessários.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras descartáveis', 'Não', 'Somente gostaria de comentar sobre a última pergunta, se as aulas voltassem (o que é uma insanidade) eu simplesmente tentaria trancar. \r\nSobre quem tem necessidades de ir até a UFRGS se quiser poder acompanhar o retorno do EAD ERE, seria a solução, mas seria uma falta de empatia com essas pessoas.', '', '', ''),
(1031, 1212, 11, '2020-06-15 12:12:01', '2020-06-16 16:37:36', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Pode ser excludente, pois muitos colegas não tem acesso e/ou condições para acompanhar. Além disso boa parte dos professores não possuem domínio das ferramentas, que já não são utilizadas a contento como complemento às aulas presenciais, tendo que ser utilizadas como única ferramenta a formação geral dos estudantes poderá ser muito preejudicada.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Seria importante que a UFRGS adotasse um planejamento sério desse período atípico. Não sabemos quanto tempo irá durar o distanciamento social e a necessidade de suspensão das atividades presenciais, qualquer modelo deverá ser pensado em termos de não deixar nenhum aluno para trás e não comprometer a qualidade do ensino e da formação nos cursos.', '', '', ''),
(1032, 145, 11, '2020-06-15 12:12:01', '2020-06-16 21:26:59', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Acho que não seria viável, visto que existem muitos alunos que não tem estrutura para tal e a UFRGS também não possui estrutura para receber estes alunos em seus laboratórios.', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1033, 1140, 11, '2020-06-15 12:12:01', '2020-06-15 18:12:38', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Tendo em vista que eu estaria tendo aulas do quinto semestre de biblio eu não gostaria de ter aulas online. Seria um semestre onde seria abordado o tesouro e outras coisas mais complicadas para serem ensinadas somente em aulas ead.\r\nTambém não vejo outra solução para dar seguimento ao semestre, mas tenho em mente que muitos alunos não possuem recursos ou tempo para acompanhar aulas ead de suas casas.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1034, 1178, 11, '2020-06-15 12:12:01', '2020-06-25 12:23:49', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Não concordo, é excludente com quem não tem condições mentais e/ou financeiras para participar de aula num momento como esse.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1035, 1832, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1036, 153, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1037, 1833, 11, '2020-06-15 12:12:01', '2020-06-21 18:51:18', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Baixa', 'Mais de 10 megas e medianamente estável', 'É uma boa alternativa para veteranos que possuem computadores, mas não me encaixo nessa condição. A universidade é nova e confusa para mim no momento, que sou bixo, portanto não conseguiria ter a atenção e aprendizado necessários para as aulas online.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Como já disse, faço uso apenas de celular e isso me prejudica, pois é um celular pequeno e meio antigo. Tenho dificuldade até de responder email nele. \r\n\r\nobs: Não sou beneficiária prae mas me encaixo nos requisitos, como tive poucos dias de aula não pude recorer ao benefício.', '', '', ''),
(1038, 157, 11, '2020-06-15 12:12:01', '2020-06-15 09:18:06', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e muito estável', 'Apesar de possuir ferramentas que me oportunizam a possibilidade de aula à distância, não vejo essa form como a mais correta - muito menos a do ensino híbrido.\r\nHá de ter em vista a situação dos alunos mais vulneráveis e que não há recursos para tal.\r\nE também, mesmo com a utilização da internet há materias na FABICO que não estão disponíveis no SABI.\r\nDesta forma, sou contra o seguimento do semestre por EaD ou híbrido. Pois, além de cair a qualidade do ensino, não compreende todos os estudantes.', 'Sim', 'Nenhuma', 'Trem', 'entre 2h30min e 3h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1039, 1834, 11, '2020-06-15 12:12:01', '2020-06-15 23:26:52', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Bom acredito que não é melhor forma de aprendizado, entretanto na atual situação acho o EaD a melhor de forma de seguir o semestre.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
