(1050, 1787, 11, '2020-06-15 12:12:01', '2020-06-15 13:33:52', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Média', 'Menos de 10 megas e medianamente estável', 'Seria bom, caso todos os estudantes e colegas tivessem os recursos eletrônicos adequados (notebook ou computadores). Fica complicado usar o smartphone para atividades mais complexas. No momento tenho notebook pq estou em Home Office e a empresa me emprestou.', 'Não', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Não está bem claro pra mim, a questão da retomada do semestre quanto as datas, se for aceita a opção EAD/híbrida. Não quero fazer as disciplinas correndo, pq tb preciso trabalhar (como vários outros colegas), se for assim trancarei a matrícula.', '', '', ''),
