(1055, 1789, 11, '2020-06-15 12:12:01', '2020-06-15 11:03:04', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e pouco estável', 'Eu acho que tem muitas pessoas que não tem acesso a internet, então seria injusto ter aulas à distância', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1056, 173, 11, '2020-06-15 12:12:01', '2020-06-15 09:29:59', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Existem algumas questões que devemos ponderar. É nítido que passamos por um processo de precarização do ensino, que visa à privatização das instituições públicas. O ensino a distância, nesse contexto, reverbera em uma perspectiva de encerramento das atividades em universidades federais. É um projeto político nefasto de afastamento da população mais vulnerável ao ensino superior. Outrossim, temos de considerar a realidade do estudante universitário de nosso curso. A grande maioria não possui acesso à internet ou mesmo dispositivos adequados para acompanhar as atividades; muitos estão em situação delicada com a família, assumindo mais responsabilidades (cuidados com idosos, crianças ou suporte financeiro); outros, ainda, estão tentando manter a sanidade mediante um contexto que urge produtividade (como é próprio do sistema capitalista), em que, mesmo em uma crise sanitária e econômica, é esperado que haja resiliência e produção. Há, ainda, aqueles que já não possuem mais renda ou estão em situação de precarização do trabalho. Também não ignoro que a educação a distância é um projeto pensado, com planos de aula específicos para essa modalidade, carecendo de formação formal, debate e preparo. Fazê-lo às pressas, adaptando as aulas, pode gerar ainda mais ansiedade nos corpos discente e docente. Deste modo, deixando claro meu posicionamento e, mesmo sendo beneficiada com essa modalidade (considerando minha saúde e por estar no último semestre do curso), sou CONTRA a educação a distância nessa situação. Sei que enfrentamos (ou enfrentaremos, em breve) restrição de recursos na universidade, por não estarmos com as atividades ocorrendo. No entanto, é imperativo cobrarmos um posicionamento do governo para mantermos a universidade nessa situação de crise. É tempo de brigarmos pela permanência do ensino público, em vez de darmos ferramentas para sua privatização.', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1057, 174, 11, '2020-06-15 12:12:01', '2020-06-15 13:38:30', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
