(1066, 1144, 11, '2020-06-15 12:12:01', '2020-06-15 13:53:23', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Por um lado, acho que é bom porque assim não perdemos o semestre, por outro lado, nem todo mundo teria condições de acessar a esses conteúdos, fora que há certos assuntos que seriam melhores resolvidos pessoalmente.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
