(1071, 1145, 11, '2020-06-15 12:12:01', '2020-06-15 10:29:17', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Todos os dispositivos', 'Alta', 'Mais de 10 megas e medianamente estável', 'Minha única preocupação são os colegas que não possuem acesso à internet. Tirando isso, vejo o ensino a distância como a solução ideal para continuar estudando, uma vez que não teria condições de ir às aulas presenciais, pois, além do vírus, a pandemia trouxe sérios problemas financeiros para minha família.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
