(1074, 188, 11, '2020-06-15 12:12:01', '2020-06-17 10:21:39', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', '', 'Não', 'Ensino à distância híbrido', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1075, 189, 11, '2020-06-15 12:12:01', '2020-06-19 15:09:07', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Acho importante pelo fato que vai ser muito difícil voltarmos a termos aulas presenciais, pois vejo que muitas pessoas não respeitam, eu com suspeita de Covid não saio de casa pra nada, mas vejo que muita gente não pensa assim. Eu acredito totalmente no potencial da ufrgs para ter aula a distância e não excluir nenhum aluno', 'Não', 'Ensino à distância assíncrono', '', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Sou do grupo de risco, porém minha irmã está atualmente com Covid 19 e o restante da família teve apenas sintomas leves. Não me sinto confortável em sair de casa pois eu por exemplo não sei se estou com a doença, acontece muito de pessoas acabarem passando sem saber', '', '', ''),
(1076, 1842, 11, '2020-06-15 12:12:01', '2020-06-15 16:50:23', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Todos os dispositivos', 'Média', 'Mais de 10 megas e medianamente estável', 'Ainda que possuo hoje os recursos para ter aulas a distância e pra mim é mais seguro ter aula a distância, é difícil opinar porque sei que nem todos tem condições de acesso não só pelas ferramentas tecnológicas necessárias mas espaço físico e condições psicológicas, visto que o momento envolve outras questões individuais e de família. Mas como tudo isso não é uma situação exclusiva só dos alunos, professores e funcionários também estão passando por dificuldades acho que a instituição juntamente com profissionais e alunos tem condições de chegar a um entendimento que contemple a todos.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'O questionário é bastante válido para ter maior conhecimento dos alunos da fabico, suas possibilidades e expectativas. Particularmente estou ansiosa por uma definição, porque a incerteza é angustiante porque até para se assumir outros compromissos neste período fica difícil, visto que não se tem data definida para recomeçar as aulas. Obrigada, aos que estão se empenhando para que tudo se resolva pelo melhor. Abraço!', '', '', ''),
