(1097, 1795, 11, '2020-06-15 12:12:01', '2020-06-20 12:47:13', 1, '', 'Não', 'Sim, estou no grupo de risco, mas não convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Seria interessante a Ufrgs disponibilizar esse recurso até a pandemia passar e ter vacina para a população. A Ufrgs tem meios de disponibilizar essa modalidade , já que algumas disciplinas professores gravam vídeos para os alunos assistir. São pouquíssimas disciplina mas esse recursos tem disponível.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Caso a Ufrgs disponibilize aulas a distância, a mesma poderia algum dia do mês abrir a biblioteca para retirado de livros. Com hora marcada ou 1 ou 2 vezes por mês dependendo da procura. Já que é muito cansativo para os olhos ler texto no celular ou computador com várias páginas num período curto de tempo quando professores deixam disponível no moodle. Mas teria que ter uma enquete com os alunos e a Ufrgs', '', '', ''),
