(1105, 216, 11, '2020-06-15 12:12:01', '2020-06-16 14:23:41', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Eu, particularmente, não teria problema em realizar o semestre a distância porque não preciso sair de casa para isso. Mas não gostaria que alunos que não têm as mesmas condições que tenho tivessem que se expor na rua para poder acessar os materiais.', 'Não', 'Ensino à distância híbrido', 'Carro próprio', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Como disse anteriormente, EU não me importaria de fazer as aulas a distância, mas só se TODOS os alunos toparem. Também não seria problema se o semestre tivesse que se alongar mais, no meu caso. Mesmo sendo futura formanda, ainda prefiro que as pessoas fiquem a salvo do que doentes.', '', '', ''),
