(1108, 220, 11, '2020-06-15 12:12:01', '2020-06-18 12:10:31', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Não tenho certeza se atividade EAD seria opção mais democrática, mas se estabelecido o ensino à distância deve ser exclusivamente durante a quarentena e considerar as necessidades específicas de cada aluno. É preciso garantir que todos tenham acesso aos recursos como internet e equipamentos (sem prejudicar o orçamento da família) para se tentar uma aprendizagem o mais equânime possível.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
