(1112, 1186, 11, '2020-06-15 12:12:01', '2020-06-15 12:17:12', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Creio que o ensino à distância seja a única possibilidade de continuar com o semestre, mesmo que, na minha opinião, seja inviável buscar o término do semestre em apenas um mês de aula sendo que já perdemos três meses. \r\nContudo, também vejo que irá demorar para tudo voltar ao notmal do jeito que a população está levando a covid como brincadeira, então concordo que não podemos continuar parados.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
