(1117, 1218, 11, '2020-06-15 12:12:01', '2020-06-19 22:54:43', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Nenhuma', 'Menos de 10 megas e medianamente estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1118, 555, 11, '2020-06-15 12:12:01', '2020-06-15 09:54:37', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Não me sinto confortável usando estes recursos, mas entendo que o momento pede um encaminhamento. Tendo em vista os perigos da pandemia, este é um caminho possível.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Por tópicos:\r\n- Começar o semestre 20/1 em 01 de julho? Questiono por que o semestre não pode ser cancelado. Será uma verdadeira loucura amassar dois semestres para concluir o ano. Outras instituições já o cancelaram.\r\n- O pico da pandemia sequer se apresentou. Algo minimamente seguro para atividades presenciais (para os colegas que precisam da estrutura da UFRGS) só seria viável, de maneira responsável, lá pela segunda quinzena de setembro. O frio é vetor potente de problemas de saúde. \r\n- A UFRGS tem carência de pessoal terceirizado e insumos de limpeza. Sempre teve. Para abrir a Fabico, todos os envolvidos (funcionários, professores e alunos) estarão em risco, o que não é aceitável em hipótese alguma.\r\n- Tenho banda-larga em casa. Digo apenas uma coisa sobre sua qualidade: Não consigo assistir a mais de uma hora de videoconferência. SEMPRE tranca. A empresa de telefonia nunca entrega o que cobra na fatura. \r\n- Sobrecarregar professores com a realidade virtual é pedir para adoecê-los. Eu sei disso muito bem. Minha profissão migrou para essa realidade e surtos foram e são naturalizados.  \r\n- Não vou me expor e não quero que ninguém se exponha em nome de um projeto conteudista. Quero sair dessa loucura toda VIVA e quero que todos saiam VIVOS!', '', '', ''),
(1119, 1848, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1120, 1849, 11, '2020-06-15 12:12:01', '2020-06-15 10:24:09', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Concordo, desde que, isso deva-se às estratégias necessárias para adequar segurança dos espaços presenciais da FABICO justamente pra quem precisa. Posso confiar nesse esforço? Adoraria fazer presencial, mas minha realidade permite estudar remotamente. Considero a possibilidade de \"trancar\" e recomeçar quando presencial for possível e seguro.', 'Sim', 'Ensino à distância híbrido', 'Trem', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1121, 1800, 11, '2020-06-15 12:12:01', '2020-06-25 01:34:01', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Dentro da situação atual , muito válido .', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1122, 235, 11, '2020-06-15 12:12:01', '2020-06-16 18:50:33', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Estamos em um momento em que devemos pensar no coletivo. Não posso responder essa questão somente levando em consideração o meu lugar de fala, uma vez que sei que há muitos alunos que dependem da estrutura da universidade para poderem se inserir nesse ambiente \"à distância\", assim, colocando-se em situação de risco, devido a deslocamentos e aglomerações.', 'Sim', 'Nenhuma', 'Bicicleta', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
