(1127, 1220, 11, '2020-06-15 12:12:01', '2020-06-15 15:15:45', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Todos os dispositivos', 'Média', 'Mais de 10 megas e muito estável', 'Acho valido para dar continuidade ao semestre desde que seja inclusivo a todos alunos da ufrgs', 'Não', 'Ensino à distância híbrido', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'No contexto da pandemia, na realidade em que vivemos; sistema de saude deficitario, transporte coletivo lotado, alguns alunos que nao possuem acesso a internet, penso que a ufrgs devia retormar somente em 2021.', '', '', ''),
