(1130, 242, 11, '2020-06-15 12:12:01', '2020-06-15 10:27:21', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Considero que de algum modo o semestre deverá ser retomado. Estou em situação atípica dos demais, pois estou no semestre do TCC, dependendo apenas da pesquisa e da orientação.', '', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1131, 244, 11, '2020-06-15 12:12:01', '2020-06-19 13:17:42', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Baixa', 'Menos de 10 megas e pouco estável', 'acredito que como esse semestre esta perto do final e considerando o estresse que o ensino a distancia traria a todos, nao seria válido a implementação de um recurso a distância nesse momento. outro ponto pessoal é que tive que voltar para a casa dos meus pais no inicio da quarentena para poder ajudá-los aqui e nao teria condições de voltar para porto alegre agora.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras descartáveis', 'Não', '', '', '', ''),
