(1134, 1801, 11, '2020-06-15 12:12:01', '2020-06-17 14:53:19', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e medianamente estável', 'Talvez seja uma boa idéia mas nunca tive esta experiência. Se todos tiverem acesso as lives ou gravações de conteúdo não vejo porque não.', 'Não', 'Ensino à distância assíncrono', 'Bicicleta', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Obrigad@.', '', '', ''),
(1135, 248, 11, '2020-06-15 12:12:01', '2020-06-17 22:34:49', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Baixa', 'Menos de 10 megas e muito estável', 'Para dar seguimento ao semestre durante a quarentena precisamos de recursos adequados para cumprir com as exigências que seremos expostos para a aprovação, sendo assim, o governo federal deve disponibilizar ferramentas aos que não possuem.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1136, 1851, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1137, 249, 11, '2020-06-15 12:12:01', '2020-06-15 09:58:49', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1138, 1222, 11, '2020-06-15 12:12:01', '2020-06-19 10:53:42', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Não me agrada, não é o ideal...', 'Sim', 'Ensino à distância por videoconferência ao vivo', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Sim', '', '', '', ''),
(1139, 253, 11, '2020-06-15 12:12:01', '2020-06-15 14:24:19', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e pouco estável', 'Possuo equipamentos antigos e pouco funcionais que, embora eu tenha bastante familiaridade, me limitam para realizar diversas atividades, ficando até mesmo inutilizáveis em alguns dias. Em relação à internet é a mesma coisa. Mesmo quando me sinto razoavelmente bem mentalmente no período de quarentena e me proponho à tentar realizar atividades por meio dos recursos tecnológicos, muitas vezes as limitações e problemáticas dos aparelhos acabam tornando o processo inviável.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h30 e 2h', 'Não possuo máscaras', 'Não', 'Acredito que não seja um bom momento para iniciar quaisquer atividades presenciais que sejam e mesmo as atividades educacionais à distância de caráter obrigatório deveriam ser repensadas de maneira a não excluir nem prejudicar nenhum aluno. Fora os aspectos psicológicos, acredito que mesmo oferecendo o espaço da faculdade para que os alunos tenham acesso aos equipamentos é algo arriscado, tendo em mente que muitos alunos vem de outras cidades e dependem de transportes públicos lotados. E ainda tem toda a questão financeira, uma vez que a economia está sendo prejudicada também e muitas pessoas tem tido diversas limitações financeiras por demissão em massa, perda de renda e outras situações semelhantes. O transporte, por si só, é bastante caro e junto com o risco da aglomeração do transporte público não me parece uma ideia muito segura, na verdade me parece que os alunos que dependem do equipamento e precisariam se locomover estariam com as vidas em risco apenas pela obrigatoriedade de realizar atividades acadêmicas. Acredito que assim como eu todos desejam retomar suas vidas em diversos aspectos, aqui destaco os aspectos profissionais e educacionais que a universidade oferece, porém nesse momento é preciso pensar também na saúde dos alunos, dos demais funcionários da UFRGS e da sociedade como um todo, pois o retorno de atividades na UFRGS causaria mais movimentação e aglomeração logo no momento em que estamos entrando na pior parte da pandemia, colocando não apenas a comunidade acadêmica em maior risco. Fora que moro com pessoas que são do grupo de risco e, mesmo que eu não seja, colocaria elas em risco.', '', '', ''),
(1140, 1802, 11, '2020-06-15 12:12:01', '2020-06-15 14:03:54', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Infelizmente acredito que o ensino remoto deverá ser adotado mais cedo ou mais tarde, caso contrário corremos o risco de perder todo o ano letivo, já que não há perspectiva de melhora a curto prazo. Dessa forma, a adoção do ensino remoto deve acontecer da forma menos traumática possível. Durante o período de pandemia, não devem ser exigidas atividades presenciais. Os professores também deverão estar cientes da delicadeza da situação e exigir dos alunos tarefas mais simples, como questionários objetivos no Moodle, por exemplo, dadas as limitações impostas pelo ensino remoto. Aos alunos que não possuem acesso à internet, esse acesso deve ser providenciado de alguma forma, ou, na pior das hipóteses, esses alunos não devem ter prejuízos em seus ordenamentos de matrícula.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Nenhuma objeção em relação à pesquisa.', '', '', ''),
(1141, 254, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1142, 257, 11, '2020-06-15 12:12:01', '2020-07-01 17:15:43', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Média', 'Menos de 10 megas e pouco estável', 'Quem não possui acesso a internet não pode nem responder esses questionários e tampouco participar desse movimento de integração dos estudos a distância, além de que pode nem estar a par que existe um movimento para a volta as aulas. Além do mais, mesmo os que tem podem ter grande dificuldade visto que sua fonte de acesso a internet pode ser compartilhada, ou o ambiente não se aproximar do minimamente adequado. Melhor seria permitir um cancelamento de matrícula emergencial que não oferece perdas de benefício, ordenamento, etc. para aqueles que não possuem condições de acompanhar a distância o semestre e seriam obrigados a arriscar a sua vida e a de sua comunidade para prosseguir com o seu curso.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Não possuo máscaras', 'Não', '', '', '', ''),
(1143, 258, 11, '2020-06-15 12:12:01', '2020-06-15 10:36:46', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Média', 'Menos de 10 megas e pouco estável', 'Não tem como opinar! O que a COMGRAD espera? Se a  internet móvel não funcionar o aluno deve entrar num transporte coletivo e arriscar sua vida para não perder aula? Isso é sério mesmo? A universidade está de acordo com as diretrizes do governo Bolsonaro? Ou será que o corpo de professores da FABICO está tão contente ganhando seus salários que já esqueceu como é ser pobre em meio a uma pandemia? Á, lembrei, esse evento é único, portanto querer dar aula a todo custo nesse cenário parece algo ligeiramente bestial.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Obrigado!', '', '', ''),
(1144, 1852, 11, '2020-06-15 12:12:01', '2020-06-16 21:28:04', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e pouco estável', '', 'Sim', 'Nenhuma', 'Carro próprio', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1145, 261, 11, '2020-06-15 12:12:01', '2020-06-17 18:57:14', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e pouco estável', 'Acredito que para os alunxs que possuem recursos em casa seja uma ótima opção, mas para quem não tem fica muito complicado, mesmo que a UFRGS abra para esses estudantes o risco de contágio em ônibus é muito alto. E como ficarão os alunxs que estão em período de estágio obrigatório?', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'A pesquisa é muito válida para quantificarem os recursos dxs alunxs. Espero que pensem no bem de todxs.', '', '', ''),
(1146, 263, 11, '2020-06-15 12:12:01', '2020-06-15 12:32:07', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Creio que o ensino à distância não seja a melhor escolha para o momento, mesmo que isso resulte em perda do semestre total, pois a UFRGS tem vários alunos que não possuem qualquer meio de comunicação estável.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', '');
