(1151, 1188, 11, '2020-06-15 12:12:01', '2020-06-19 09:20:43', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e pouco estável', 'É interessante, mas não são todos alunos que tem acesso a esse tipo de recurso.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1152, 1223, 11, '2020-06-15 12:12:01', '2020-06-15 10:43:10', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e pouco estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1153, 266, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1154, 1224, 11, '2020-06-15 12:12:01', '2020-06-17 12:04:05', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Acredito que seria uma boa alternativa se todos os alunos pudessem usar esses recursos.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1155, 1225, 11, '2020-06-15 12:12:01', '2020-06-19 12:34:29', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Acredito que seria a melhor maneira de dar seguimento ao semestre, mas ao mesmo tempo sei que nem todo mundo tem um computador ou acesso a internet em casa, só que levando em consideração o fato de que o Brasil não está levando a sério o isolamento social, não acho que seria uma boa ideia voltar com aulas presenciais de nenhuma forma.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1156, 267, 11, '2020-06-15 12:12:01', '2020-06-20 17:20:31', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Média', 'Menos de 10 megas e pouco estável', 'Elitista, excludente, racista e capacitista. \r\n\r\nMuitos alunos não tem condições econômicas, tecnológicas, físicas e psicológicas para seguirem com o semestre, ainda mais um organizado às pressas e sem todo um pensar de qualidade por trás. Numa tentativa de largarem a frente de outras universidades e mostrarem produtividade, estão jogando diversas pessoas para baixo do ônibus. Chocante.\r\n\r\nEstamos em meio a uma pandemia! Sem ser alarmista, mas apenas seguindo o que os estudos científicos estão nos dizendo, o índice de infecção segue crescendo, as mortes continuam se apilhando e a situação continua arrebentando para o lado mais fraco da população. Pessoas negras, de baixa renda, que estão lutando pra sobreviverem em uma época onde o desemprego segue aumentando, devem se preocupar com seguir o semestre de aula em formato EAD (sendo que muito não possuem as ferramentas e condições mentais e/ou físicas para seguir com mais essa ocupação)? \r\n\r\nNem eu que estou na reta final da universidade, onde a prioridade é a produção do TCC, estou apta para tal atividade uma vez que vejo conhecidos se infectando e morrendo de Covid-19 dentro do meu próprio bairro, quem dirá os estudantes que ainda tem um semestre cheio a frente e também se encontram com outras dificuldades? Não há sanidade mental que se mantenha intacta em situações deste tipo.  \r\n\r\nMe oponho completamente à decisão de retomada de semestre.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1157, 1853, 11, '2020-06-15 12:12:01', '2020-06-15 10:57:39', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Tendo em vista as diferentes realidades e a situação instável da pandemia, acho que a melhor forma de dar continuidade às aulas seja o ensino à distância assíncrono, pois permite aos estudantes acessar às aulas/materiais e realizar as atividades no melhor horário de acordo com seu cotidiano. Contudo, tal forma ainda é desigual, já que aqueles que não têm meios de acesso à internet seriam prejudicados.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 2h30min e 3h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1158, 1154, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1159, 1854, 11, '2020-06-15 12:12:01', '2020-06-17 13:50:53', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Média', 'Mais de 10 megas e medianamente estável', 'Acho difícil pois nem todo mundo tem acesso a computador e internet. E dependendo de quantas pessoas da família tem em casa, pode não ser um ambiente propício para estudar, por causa do barulho e as tarefas de casa.', 'Sim', 'Nenhuma', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1160, 268, 11, '2020-06-15 12:12:01', '2020-06-15 09:13:50', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Alta', 'Menos de 10 megas e pouco estável', 'Deve ser avaliado, muitos utilizam como forma de escape para o fim das aulas presenciais e professores que não querem mais lecionar para a graduação. Já participei de turmas que não havia qualquer mediação, muitos alunos e somente textos digitais. Isso não é ensino por intermédio de recursos digitais, apenas material digital. Para isso posso usar o Google e não uma faculdade federal.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 2h e 2h30min', 'Sim, possuo máscaras de pano', 'Não', 'Ensino emergencial não é solução. O fato é que ninguém sabe quando isso irá terminar, tão pouco estão fazendo algo para evitar a pandemia. Vejo somente a necessidade de voltar às normalidades, mas quando vão pensar no cuidado do aluno e na segurança deles para isso?', '', '', ''),
