(1183, 1807, 11, '2020-06-15 12:12:01', '2020-06-15 18:32:04', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Estou fazendo um curso de extensão EAD e está indo tranquilo. Não gosto dessa modalidade (EAD) por  soterrar os alunos de trabalhos e pouca explicação(tenho contato com pessoas  que utilizam o ensino dessa forma. Se faz muito e se aprende pouco. Em julho terminaria o semestre, ao meu ver, o semestre está encerrado. Quanto ao próximo semestre tenho esperança de fazê-lo presencialmente, caso não possa, se for \r\n EAD farei menos cadeiras, só para não  trancar.', 'Não', 'Ensino à distância por videoconferência ao vivo', 'Trem', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', 'Em relação ao transporte: Penso que deveria dar possibilidade para marcar mais de um item, eu por exemplo, pego 2 ônibus e o Trem, difícil dizer qual é o mais importante, se os ônibus não operam em horários de escala normal complica toda logística e o mesmo ocorre com o trem.', '', '', ''),
(1184, 1808, 11, '2020-06-15 12:12:01', '2020-06-16 13:25:05', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Média', 'Menos de 10 megas e pouco estável', 'Gostaria de dar segmento as aulas mesmo que a distancia porém não possuo recursos quais possa depender para entregar sempre o melhor resultado visto que minha internet é somente 4g e que roteio para o computador. Sendo limitada, pois existe um limite de dados mensal, para pesquisas, videos e afins é possível que acabasse minha internet, e teria que recontratar pacotes sempre que fosse utilizar.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'apesar de não estar confortável frequentar a UFRGS durante essa pandemia eu iria para utilizar a estrutura afim de realizar trabalhos ou assitir video aulas.', '', '', ''),
