(1189, 1809, 11, '2020-06-15 12:12:01', '2020-06-15 13:35:03', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Entendo como necessário o ensino remoto devido a necessidade de distanciamento físico e a impossibilidade estrutural da ufrgs em dividir turmas, mas acredito que a maior dificuldade será em atividades que demandam laboratório e para alunos que não tem disponibilidade de internet nem de equipamentos adequados para acompanhar o semestre. Isto preocupa na medida que pode desencadear a evasão de alunos que não tem os recursos adequados para acompanhar este ensino remoto.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1190, 1855, 11, '2020-06-15 12:12:01', '2020-06-15 09:32:13', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Nem todos conseguirão acompanhar um semestre à distância e ainda não foi especificado o que acontece com os que não tiverem condições de prosseguir, se haverá uma opção de cancelamento de matrícula emergencial que não prejudique o ordenamento, ou alguma tentativa de contornar o problema (não considero viável EAD híbrido, pois atenta contra o estudante que se desloca até a universidade, seus familiares e todos os funcionários envolvidos). Acredito que acompanhando caso a caso, focando na necessidade dos indivíduos específicos mais do que na de um corpo discente genérico, seja possível obter um quadro mais palpável sobre essa questão. Quanto aos recursos à distância em si, diante da precariedade da UFRGS, escancarada quando a universidade propõe o ERE (um sistema que burla a jurisdição que valida o EAD), devemos admitir que não se pode considerar as aulas à distância equivalentes às presenciais em termos de aprendizado.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras descartáveis', 'Não', '', '', '', ''),
