(1198, 1229, 11, '2020-06-15 12:12:01', '2020-06-15 11:07:03', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Todos os dispositivos', 'Alta', 'Mais de 10 megas e muito estável', 'Sou a favor, pois as atividades de ensino devem permanecer para continuar se produzindo pesquisa e extensão nas universidades. Existem várias soluções disponíveis para o estudo, e todas as pessoas que conheço (PRAE ou não) possuem algum tipo de acesso a internet.', 'Não', 'Ensino à distância híbrido', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Sim', 'O questionário possui questões muito fechadas o que deixa o mesmo alinhado a uma linha de pensamento e raciocínio. \r\nO PRAE da UFRGS, assim como outras universidades federais, podem atuar apoiando alunos para contratarem planos de internet. \r\nOs cuidados e a prevenção ao novo coronavírus não é só responsabilidade das instituições, as pessoas também devem se proteger e se responsabilizar.\r\nEm relação a saúde mental, possuo muito mais ansiedade preocupado com a volta as aulas presencial com o calendário acadêmico atrasado, pois conheço muitos professores que vão encher de 1000 trabalhos escritos pra entregar a cada 3 dias para compensar as aulas \"perdidas\" e dizer que deram aula. Aula presencial na FABICO já é uma piada antes da pandemia, agora pensa com calendário atrasado. \r\nOutra coisa é que o tempo parado em casa, sem estudar/trabalhar, prejudica muito mais a saúde mental. Caso tivéssemos um norte de leituras, artigos, e material elaborado pelo professor para estudar seria muito mais proveitoso o nosso tempo.', '', '', ''),
