(1202, 313, 11, '2020-06-15 12:12:01', '2020-06-18 01:54:42', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Média', 'Menos de 10 megas e medianamente estável', '', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1203, 1812, 11, '2020-06-15 12:12:01', '2020-06-15 13:14:25', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Baixa', 'Menos de 10 megas e medianamente estável', 'Para uma faculdade federal os recursos para dar aula a distância não funcionam, eles são exclusivos!', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1204, 314, 11, '2020-06-15 12:12:01', '2020-06-15 10:52:55', 1, '', 'Não', 'Sim, estou no grupo de risco, mas não convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Todos os dispositivos', 'Alta', 'Mais de 10 megas e muito estável', 'Fundamental usar esses recursos. Não são todas as pessoas que serão atendidas neste momento por diversas razões (técnicas e ou psicológicas) mas é preciso seguir em frente. A sugestão é não penalizar quem não puder acompanhar as aulas online. Melhor do que perder o semestre, já que ele não pode ser cancelado.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Sugestão: cancelem o semestre. Na impossibilidade de fazer isso, organizam atividades online assíncronas, lives, o conteúdo que for possivel passar. Fará mais bem do que mal para a saúde mental dos estudantes, vai mantê-los ocupados. E quem não puder ou não se sentir bem para estudar assim, que tenha o semestre trancado porém sem sofrer com seu ordenamento. Não tem como atender todo mundo. Alguém  vai ficar em desvantagem. Pelo menos assim ninguém será gravemente penalizado.', '', '', ''),
(1205, 1856, 11, '2020-06-15 12:12:01', '2020-06-15 11:34:56', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Computador (notebook)', 'Média', 'Menos de 10 megas e medianamente estável', 'No momento estou no interior com a minha mãe e pretendo ficar aqui até a pandemia passar, pois ainda não sou beneficiária PRAE e caso voltasse agora, sou do grupo de risco e também teria problemas financeiros para permanecer em Porto Alegre (ex. alimentação, com o RU fechado).\r\nA minha internet aqui não é das melhores, mas consigo acompanhar as aulas pelo moodle e participar dos chats. Por isso voto no ensino à distância assíncrono, se não houver opção melhor.\r\nNão gostaria de perder o semestre, estou no 1° de Biblioteconomia, mas também não quero que ninguém seja prejudicado.\r\nEstou acompanhando as reuniões do Cabam e na torcida para que juntos possamos chegar a um consenso que seja tranquilo para todos.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', 'Gostei da pesquisa, bem elaborada.', '', '', ''),
(1206, 1192, 11, '2020-06-15 12:12:01', '2020-06-19 14:10:29', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular', 'Média', 'Menos de 10 megas e muito estável', 'Melhor retomar o semestre do zero ano que vem. Quero que tudo volte ao normal logo. Mas minha saúde  mental nessa pandemia já era e outra coisa: uso internet pré-paga, quem usa essa internet, não consegue fazer longas peaquisas . Se usarem EAD não podem dar prazos curtos pra entrega de trabalho e fazer pesquisa no celular é horrível.  Enviar trabalhos pelo Moodle também horrível.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', 'Estamos vivendo o que eu chamo de \" tempo de guerra\". Em tempo de guerra não temos condições  financeiras, nem psicológicas para cumprir exigências acadêmicas. Acho melhor sermos honestos e reconhecermos qie perdemos o ano. Grata. Vamoa esperar 2021. É triste mas é a melhor saída. Daí teremos os laboratórios da faculdade disponíveis e sem risco de contaminação e com aulas normais. Grata.', '', '', ''),
(1207, 1857, 11, '2020-06-15 12:12:01', '2020-06-19 03:09:19', 1, '', 'Não', 'Sim, estou no grupo de risco, mas não convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Na minha opinião, recursos exclusivamente eletrônicos não são inclusivos para todos os alunos. Assim como aulas presenciais não podem ser consideradas no momento (visto o perigo), não acho que aulas online sejam a melhor maneira de seguir o semestre se não será justo para 100% dos alunos.\r\nParticularmente, prefiro o cancelamente do semestre e, possivelmente, do ano letivo se isso for o mais justo e seguro à todos.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras descartáveis', 'Não', '', '', '', ''),
(1208, 1193, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1209, 317, 11, '2020-06-15 12:12:01', '2020-06-15 13:56:12', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', '', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1210, 1813, 11, '2020-06-15 12:12:01', '2020-06-15 09:14:24', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Para alguns alunos pode ser um benefício, para outros, um pesadelo. Acredito que se há algumas exceções não deve haver aula para ninguem, para que nesse momento haja o mínimo de igualdade. E levar essas pessoas que não tem condições de acesso à plataforma digital para o campus, potencializaria o perigo de contágio delas, dos famílias delas e do prédio em si. Acredito que a UFRGS não está pronta para essa modalidade de ensino por não ser uma faculdade que exclui indivíduos.', 'Sim', 'Ensino à distância por videoconferência ao vivo', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1211, 1160, 11, '2020-06-15 12:12:01', '2020-06-15 11:55:25', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e pouco estável', 'Me oponho ao uso de tais recursos pois acredito que a qualidade do ensino poderia ser prejudicada, além do fato de ser excludente com as pessoas que não tem acesso a uma internet de qualidade e/ou dispositivos eletrônicos. Sem contar com as inúmeras outras dificuldades inerentes ao período da pandemia.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1212, 1161, 11, '2020-06-15 12:12:01', '2020-06-17 13:44:58', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Outro', 'Celular e computador', 'Baixa', 'Menos de 10 megas e medianamente estável', 'Não são todas as pessoas que têm acesso aos recursos mínimos para ter aula a distância, logo acho inviável.', 'Sim', 'Nenhuma', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1213, 1230, 11, '2020-06-15 12:12:01', '2020-06-15 19:41:37', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Devido ao pouco tempo de preparação para esse tipo de atividade, tanto dos professores quanto de suas respectivas disciplinas, acho que a adaptação acarretaria em perda qualidade no ensino, fora os outros tantos obstáculos provenientes da desigualdade, impedindo assim a turma manter um nível de paridade aceitável.', 'Sim', 'Nenhuma', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1214, 1231, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
