(1220, 1195, 11, '2020-06-15 12:12:01', '2020-06-15 20:18:59', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e medianamente estável', 'O uso de recursos à distância é essencial para um seguimento remoto do semestre.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1221, 1815, 11, '2020-06-15 12:12:01', '2020-06-15 16:38:48', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'acho uma boa opção, desde que seja levado em consideração que nem todos os alunos da universidade tem essa acesso a distância e proponham alternativas para que todos tenha condições de dar seguimento ao semestre.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1222, 671, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1223, 1163, 11, '2020-06-15 12:12:01', '2020-06-15 13:04:21', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Menos de 10 megas e medianamente estável', 'Inviável, visto que nem todos possuem acesso.', 'Sim', 'Nenhuma', 'Trem', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1224, 336, 11, '2020-06-15 12:12:01', '2020-06-15 10:12:22', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Mais de 10 megas e medianamente estável', 'O uso de recursos à distância é uma das únicas formas seguras de dar continuidade ao ensino durante a pandemia. Entretanto, só será uma opção justa se forem disponibilizados acesso à internet e dispositivo para aula aos que não os possuem. Além disso, sinto que será difícil manter o mesmo nível de ensino em termos de carga de trabalho, já que muitas pessoas (eu inclusa) possuem acesso reduzido ao computador devido a uma maior carga de tarefas em casa/dividir espaço com outra(s) pessoa(s).', 'Sim', 'Ensino à distância por videoconferência ao vivo', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1225, 1232, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1226, 338, 11, '2020-06-15 12:12:01', '2020-06-15 09:30:55', 1, '', 'Não', 'Sim, estou no grupo de risco, mas não convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Tablet e celular', 'Alta', 'Menos de 10 megas e pouco estável', 'Como estou no último semestre, preciso fazer o estágio, então não vejo como a aula a distância teria relevância, ademais, estou em trabalho remoto e ainda tenho que dividir os dispositivos com a minha filha, pois a escola seguiu as atividades no Classroom.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Não vejo a menor necessidade de voltar às aulas, isso sim iria prejudicar ainda mais a minha saúde mental. Em plena pandemia, rui relotada, perdi 20% dos proventos e não sei até quando conseguirei honrar com a internet em casa. Estou completamente sobrecarregada, tenho que ensinar minha filha pois a aula ead para crianças não funciona, eles não tem maturidade e os professores da educação fundamental presencial  não tem a menor habilidade com ead.', '', '', ''),
(1227, 339, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1228, 340, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1229, 1233, 11, '2020-06-15 12:12:01', '2020-06-15 13:10:30', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Tablet e computador (notebook)', 'Alta', 'Mais de 10 megas e medianamente estável', 'Eu não considero justo. Por exemplo, eu só tenho um notebook agora para dar seguimento aos meus estudos, porque uma amiga me emprestou. Mas as pessoas que não tem nem como conseguir emprestado? E muito menos comprar considerando esse cenário de comércios fechados? A pergunta se responde por si só. Gostaria de apontar outro aspecto que seriam as aulas que tem necessidade de desenvolvimento prático, o método EAD/ERE não é eficaz. A questão é que existem muitos pormenores e o futuro cenário provavelmente será de evasão e alunos com menor estrutura se submetendo a riscos se adotarem um sistema hibrido, começando pelo transporte público e terminando dentro da instituição se ela não tomar medidas de higiene básica para proteger seus alunos e funcionários. Vale destacar também que Porto Alegre está em alerta com números de casos aumentando e o estado já tem quatro cidades com bandeira vermelha. Muitos alunos moram em outras regiões do estado e a comunidade da faculdade em circulação é um risco não só para nós mesmos como para a comunidade externa.', 'Sim', 'Nenhuma', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'É uma boa iniciativa abrir um espaço para os alunos darem suas opiniões escritas. Não pude participar da última reunião do Cabam por causa do horário e sou muito ruim para me manifestar verbalmente, então abrir esse espaço é fundamental para abrirmos a nossa mente para conhecer diversas realidades que poderão sair perdendo com aulas à distância. Obrigado.', '', '', ''),
(1230, 1816, 11, '2020-06-15 12:12:01', '2020-06-16 11:14:29', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', '', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1231, 341, 11, '2020-06-15 12:12:01', '2020-06-15 10:26:08', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Algumas disciplinas proporcionam trocas entre docentes e discentes importantes para o desenvolvimento acadêmico e pessoal, tanto dos alunos como dos professores. Embora o EAD possibilite passar por alguns conteúdos, nem toda disciplina está preparada (ou deve estar) para essa modalidade, com o ônus do aprendizado ser prejudicado e acarretar em dificuldades na vida profissional ou acadêmica do discente.\r\n\r\nRelativo ao ensino híbrido, tendo a discordar totalmente, pois coloca alunos, servidores e terceirizados em risco desnecessário, na pressa de formar bibliotecários que dificilmente terão espaço pra se colocar no mercado de trabalho em um momento que os casos de Covid-19 estão em crescimento. Logo, é preferível que se mantenham nos estágios, trabalhando e auxiliando na renda familiar.\r\n\r\nPorém, é fácil criar laços de empatia com os alunos que podem estudar no momento e que desejam fazer isso para aproveitar os momentos em casa. Acredito que a única alternativa possível para isso é avaliar se a disciplina (obrigatória ou eletiva) é traduzível para o ensino a distância e oferecer isso sem ônus para os alunos que não tenham possibilidade de acesso. Apesar da possibilidade de trancarem o semestre, talvez alguns não tenham essa opção, por conta de já terem utilizado o recurso ou mesmo venham a precisar por outras razões.\r\n\r\nDito isto, a existência de um vínculo entre o aluno e a universidade é essencial, pois alguns alunos, mesmo durante a pandemia, ainda estão vinculados e atuantes nos seus estágios de forma remota. Esse vínculo com a universidade permite que o aluno se mantenha em casa com segurança, argumento que também é válido aos alunos que se beneficiam de algum programa de assistência. Em um país em que o auxílio emergencial é de R$ 600 (que será de R$ 300 em breve), o vínculo com a universidade é essencial, ainda mais se considerarmos o crescente desemprego do país e o papel desses alunos .', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Do ponto de vista metodológico o questionário induz respostas, como a indicação da existência de um consenso sobre o tópico questionado. Porém, acredito que seja necessário se posicionar no momento atual e buscar alternativas para não prejudicar ou colocar alunos e trabalhadores em risco.\r\n\r\nPor fim, reforço a importância do vínculo do aluno com a universidade pelas questões de estágio e demais benefícios. Além de que qualquer alternativa de retomar as aulas NÃO devem acarretar ônus para os alunos que não tiverem possibilidade de ir à faculdade ou não se sintam confortável de estudar no momento atual. \r\n\r\nÉ um tempo atípico, não existe \"voltar\" ao normal, daqui só vamos para frente. Ainda mais com previsões de vacina em junho/julho de 2021.', '', '', ''),
(1232, 1234, 11, '2020-06-15 12:12:01', '2020-06-15 10:38:41', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Menos de 10 megas e muito estável', 'Eu acho complicado visto que nem todos tem os mesmos mecanismos a sua disposição, acredito que para o momento em que vivemos a melhor saída é a utilização do Semestre Bônus.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1233, 79, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1234, 1211, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1235, 172, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1236, 247, 11, '2020-06-15 12:12:01', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1237, 1858, 11, '2020-06-15 12:12:01', '2020-06-15 21:55:57', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Seria fantástico mas, ao mesmo tempo, penso que continuar em EaD seria restritivo; estou em uma situação que me deixa confortável para seguir o semestre neste formato (possui internet, computador, etc.), mas vários colegas não possuem. Se não pudermos todos, não sinto que seria a coisa certa a fazer. E os estudantes que são grupo de risco mas não possuem a tecnologia necessária para continuarmos? É uma decisão difícil.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1238, 1859, 12, '2020-06-15 14:11:58', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
