(1313, 166, 12, '2020-06-15 14:11:58', '2020-06-19 15:26:27', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Computador (notebook)', 'Alta', 'Menos de 10 megas e pouco estável', 'No meu ponto de vista é prejudicial para pessoas em situações como a minha, ou piores que a minha. Possuo um computador antigo que de vez em quando desliga sozinho e que tranca dependendo dos programas que abro e nunca sei até quando esse computador funcionará, logo que ele tem mais de 15 anos (não tenho condições financeiras para comprar outro). Não possuo webcam para conferências. Moro em uma região com muitas árvores e quando tem temporal normalmente acaba faltando luz. Costumava fazer a maioria dos trabalhos da faculdade nos computadores dos laboratórios de informática. Gostaria muito de dar seguimento ao semestre, mas se isso for acontecer acho que os professores teriam que entender que nem todo mundo passa pela mesma situação, e que, apesar de ter equipamentos, não significa que terei acesso completo a tudo que for exigido.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Moro com duas pessoas que estão no grupo de risco, meu irmão, que é asmático, e minha mãe, que é idosa e tem enfisema pulmonar. Não saio de casa desde o dia 14 de março e não pretendo sair enquanto sair signifique colocar meus familiares em risco. Se for realmente necessário o ensino a distância opto por ele, apesar de ter certeza que muitas pessoas serão prejudicadas por isso, inclusive eu.', '', '', ''),
