(1399, 1362, 13, '2020-06-15 14:42:47', '2020-06-19 10:40:57', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e muito estável', 'Eu acho ótimo! Assim, não sairíamos prejudicados e poderíamos estudar com maior segurança.\r\nPois moro em Garopaba, SC, faço apenas uma disciplina, e o TCC. Pra mim ficaria inviável ir à POA, somente para um disciplina. Sendo que aqui quase não há casos.\r\nEm POA, por ser capital, tenho grande receio de voltar, pois a propagação do vírus é muito maior, não me sentiria à vontade.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'mais de 4h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
