(1402, 1393, 13, '2020-06-15 14:42:47', '2020-06-18 17:40:51', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e muito estável', 'Sou a favor das aulas à distância nesse momento.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Muito boa a pesquisa. Gostaria de continuar as aulas. Recebendo os conteúdos e os professores fazendo vídeo aula para tirar dúvidas. Sempre no horário das aulas, porque durante o dia eu trabalho.', '', '', ''),
(1403, 2201, 13, '2020-06-15 14:42:47', '2020-06-15 12:40:16', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Sou favorável ao ensino EAD ao menos no período da pandemia, porém, vale lembrar que os estudos tem, obrigatoriamente que ser readequados para esta nova modalidade. Não é viável seguir os moldes do ensino presencial.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', 'As salas de aula que frequentei na FABICO e antes, na EA, são pequenas para a quantidade de alunos portanto, neste momento, não é possível aula presencial sem aglomeração.', '', '', ''),
