(1439, 1386, 13, '2020-06-15 14:42:47', '2020-06-15 12:45:17', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Outro', 'Celular', 'Média', 'Menos de 10 megas e pouco estável', 'Para quem tem acesso a uma internet com velocidade de qualidade e dispositivos como laptop e computador de mesa é viável as propostas de seguimento do semestre durante a quarentena, no meu caso específico não tenho computador dependo do celular para usar a internet e dependo da internet banda larga da minha irmã que é minha vizinha, mas o sinal é bem fraco e as vezes não funciona.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
