(1451, 1317, 13, '2020-06-15 14:42:47', '2020-06-17 22:20:58', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Sou a favor para os interessados, porém com a possibilidade de que os demais cancelem matrículas sem prejuízos ou penalizações. No meu ver, as cadeiras obrigatórias e de maior valor instrutivo não terão a mesma qualidade e por isso optaria apenas por cadeiras já planejadas para o formato EAD ou cujos encontros presenciais não fossem tão importantes no plano de ensino e o assunto em si não seja da maior prioridade para o curso.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Haverá cruzamento de dados entre o número de alunos e o das respostas. Não consigo evitar o questionamento, se um dos maiores impedimentos da transição para o modelo de EAD é o fato de diversos alunos não terem acesso constante à internet, como essa pesquisa garantirá que eles serão ouvidos em peso? Tenho ouvido essa pergunta de colegas e até de membros fora da comunidade acadêmica, estando de fora dos processos ainda estou com essa dúvida.', '', '', ''),
