(1457, 2193, 13, '2020-06-15 14:42:47', '2020-06-16 17:34:59', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Não', '', 'Possuo acesso predominantemente a internet móvel', '', 'Média', 'Mais de 10 megas e medianamente estável', 'Ao mesmo tempo que nem todos tem acesso à uma internet boa ou equipamentos acessíveis, seria interessante ao menos tentar uma adaptação com o EAD. Tentar adaptar os trabalhos em grupo para atividades individuais por exemplo. Não fazer nada ao vivo pois isso pode ser prejudicial, mas deixar material disponível e alguns vídeos feitos pelo professor e qualquer coisa o aluno poder ter oportunidade de conversar em um chat com o professor ou até de marcar alguma vídeo chamada ou ligação com o aluno, para que possa haver retirada de dúvidas. Pode parecer egoísta mas seria interessante a universidade tentar se adaptar a novas situações. E os que não podem, que eles possam trancar o semestre sem serem prejudicados.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1458, 1310, 13, '2020-06-15 14:42:47', '2020-06-15 13:46:57', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Menos de 10 megas e medianamente estável', 'Poderia ser à distância, mas teria que ter um prazo mais flexível para entrega de trabalhos, provas e assistir aulas, pois tenho um filho de 2 anos que demanda atenção, então não tenho horário fixo para assistir aulas', 'Sim', 'Ensino à distância assíncrono', 'Carro próprio', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
