(1466, 1302, 13, '2020-06-15 14:42:47', '2020-06-15 16:30:26', 1, '', 'Não', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Acho interessante termos opções aos alunos, que a mesma cadeira tenha a opção de cursar on line para quem assim desejar e que exista a possibilidade de quem não possa ou não queira fazer ela presencial posteriormente. Assim ninguém sai prejudicado.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', 'Acredito ser inviável um retorno às aulas presenciais neste momento, porém acho que deve existir a opção de escolha para quem quer cursar agora on line ou no próximo semestre ou próximo ano presencial. Acho importantíssimo a pesquisa, pois demonstra a preocupação da universidade para com seus alunos.', '', '', ''),
(1467, 1301, 13, '2020-06-15 14:42:47', '2020-06-17 18:29:06', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Média', 'Menos de 10 megas e pouco estável', 'A tecnologia é uma ferramenta poderosa. Devemos utilizá-la sempre que necessário principalmente em prol da saúde, educação e segurança. No caso, acredito que apesar de ser uma alternativa viável não devemos nos apegar somente a este recurso. Até porque nem todos dispõem de equipamentos modernos e/ou uma estrutura telefônica eficiente, séria e confiável.', 'Não', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1468, 2191, 13, '2020-06-15 14:42:47', '0000-00-00 00:00:00', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(1469, 1300, 13, '2020-06-15 14:42:47', '2020-06-16 15:51:52', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acho que algumas aulas podem ser passadas em EAD, principalmente as mais teóricas. O problema está no acesso aos textos das disciplinas, por conta da qualidade das digitalizações, e a necessidade de exercícios e aulas práticas em alguns casos. Os professores também teriam que saber mexer nas plataformas para ajudar e tirar as dúvidas dos alunos.', 'Não', 'Ensino à distância por videoconferência ao vivo', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1470, 1299, 13, '2020-06-15 14:42:47', '2020-06-15 14:03:49', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Baixa', 'Menos de 10 megas e muito estável', '', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 1h30 e 2h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1471, 2190, 13, '2020-06-15 14:42:47', '2020-06-19 11:13:36', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Alta', 'Mais de 10 megas e medianamente estável', 'Para mim é uma importante forma de continuidade do semestre 2020/01. Topo seguir nesse formato, somente enquanto durar o período de excepcionalidade relacionado com a questão de saúde pública. Porém, no contexto geral, sei que muitos colegas não possuem acesso à Internet (seja dados ou banda larga), bem como não possuem equipamentos de informática ou celular moderno que permitam o acesso às aulas. Vou acatar o que decidir a maioria (seja continuar nesse formato, ou aguardar até que a situação seja normalizada).', 'Sim', 'Ensino à distância híbrido', 'Trem', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Pesquisa muito importante para que se saiba o panorama geral dos colegas. Bem feita e decisiva quanto à continuidade ou não do semestre conforme proposta já enviada por e-mail pela Comgrad do curso.', '', '', ''),
