(1479, 2187, 13, '2020-06-15 14:42:47', '2020-06-17 15:07:12', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Sou aluna do curso de Arquivologia, porém sou uma pessoa com uma certa vivência, tenho 42 anos. Minha filha é biomédica e ela trabalha diretamente com exames e pesquisas do Covid-19. Como mestranda e participante da ANPG ela é contra qualquer forma de retorno agora... por ser uma universidade pública   o acesso TEM que ser igualitário para todos, seja o meio que for. Outra questão é a saúde... o deslocamento implica em risco seja ele qual for e se todos não tiverem acesso remoto de qualidade como fica? É justo? Eu particularmente voltaria EAD se TODOS tivessem disponibilidade igualitária de acesso. Senão acho injusto e excludente.', 'Não', 'Ensino à distância por videoconferência ao vivo', 'Caminhar', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
