(1490, 1285, 13, '2020-06-15 14:42:47', '2020-06-15 11:53:49', 1, '', 'Sim', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Computador (notebook)', 'Alta', 'Mais de 10 megas e muito estável', 'Aprovo', 'Sim', 'Ensino à distância por videoconferência ao vivo', 'Ônibus', 'Menos de meia hora', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1491, 1384, 13, '2020-06-15 14:42:47', '2020-06-15 12:02:55', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Mais de 10 megas e pouco estável', 'Não renovei minha matrícula em Arquivologia em 2020/01, mas vou deixar minha opinião. Era estudante de cursinho pré-vestibular e larguei os estudos pois continuo trabalhando em horário comercial. Os períodos de deslocamento para o trabalho aumentaram e o volume de aulas on-line também, o que impossibilitou que eu acompanhasse as aulas. (Ex: aula de História presencial em média durava 01:20 h; com recurso a distância as atividades chegavam a meio turno...) A forma de acompanhamento de aulas on-line é muito diferente da presencial. Não sou contra o Ead, mas excesso de atividades remotas vai fazer muita gente desistir no meio do caminho.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
(1492, 1284, 13, '2020-06-15 14:42:47', '2020-06-19 13:28:05', 1, '', 'Não', 'Não estou no grupo de risco e não vivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular', 'Média', 'Mais de 10 megas e pouco estável', 'Acho valido o uso de recursos a distancia pra dar prosseguimento ao semestre.', 'Não', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Achei a pesquisa muito boa, da pra se ter uma noção individual da situação de cada pessoas neste momento tão surreal e complexo que todos nós estamos vivendo, obrigada.', '', '', ''),
(1493, 2182, 13, '2020-06-15 14:42:47', '2020-06-18 01:51:47', 1, '', 'Sim', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Sou contra pois acredito que muitas pessoas podem sair prejudicadas com o ensino remoto, pois não possuem em casa um espaço para estudo, e privacidade para poder se dedicar as aulas, mesmo que possuam internet de qualidade. Além de que mentalmente muitas delas podem não se sentir dispostas por conta do momento em que nos encontramos.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
