(1498, 1278, 13, '2020-06-15 14:42:47', '2020-06-19 14:36:31', 1, '', 'Sim', 'Sim, estou no grupo de risco e convivo com outra(s) pessoa(s) que também está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet móvel', 'Celular e computador', 'Média', 'Menos de 10 megas e pouco estável', 'Não tenho opinião formada.', 'Sim', 'Ensino à distância híbrido', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', 'Sendo mãe, gestante, asmática e integrante do grupo de risco não me sinto a vontade em sair de casa para fazer nada. Estudar em casa tendo um filho de 5 anos, não me parece uma opção viável e por isso eu igualmente teria que me deslocar até a faculdade. Creio que já perdemos esse semestre, acho que agora não é o momento de retornar a qq atividade.', '', '', ''),
