(1504, 2180, 13, '2020-06-15 14:42:47', '2020-06-15 13:11:25', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e medianamente estável', 'Acredito que, infelizmente, o uso de recursos à distância não vai garantir do aprendizado de fato dos conteúdos. Tirando o fato que muitas pessoas não tem acesso à internet ou não  tem um computador de boa qualidade para acompanhar as aulas EAD', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 1h e 1h30min', 'Sim, possuo máscaras de pano', 'Não', 'Caso fique definido o uso de recursos à distância para dar continuidade ao semestre, acho válido abortar assuntos para combater o COVID-19, com a intenção de transformar os alunos em ferramentas contra o vírus e sua proliferação, em vez de encher os estudantes de conteúdos. \r\n\r\nObrigada', '', '', ''),
(1505, 2179, 13, '2020-06-15 14:42:47', '2020-06-15 15:53:55', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Não', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Baixa', 'Mais de 10 megas e medianamente estável', 'Olhando isoladamente para o meu caso, acho válido. Mas questiono se seria o mais justo, pois tem pessoas que não tem os mesmos recursos que eu, então não sei se seria a forma ideal de a Universidade manter suas atividades.', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
