(1508, 2178, 13, '2020-06-15 14:42:47', '2020-06-15 14:14:44', 1, '', 'Não', 'Não estou no grupo de risco, mas convivo com outra(s) pessoa(s) que está/estão', 'Sim', '', 'Possuo acesso predominantemente a internet banda larga', 'Celular e computador', 'Média', 'Mais de 10 megas e muito estável', 'Não é justo com quem não tem acesso a internet e precisará se expor em ambientes públicos para ir até a faculdade, esperar um tempão nas paradas de ônibus (já que as linhas estão com horários limitados), somente para ter uma aula \"mais ou menos\".', 'Sim', 'Ensino à distância assíncrono', 'Ônibus', 'entre 30 minutos e 1h', 'Sim, possuo máscaras de pano', 'Não', '', '', '', ''),
