INSERT INTO `events` (`id_e`, `e_name`, `e_data_i`, `e_data_f`, `e_status`, `e_texto`, `e_data`, `e_ass_none_1`, `e_ass_cargo_1`, `e_ass_none_2`, `e_ass_cargo_2`, `e_ass_none_3`, `e_ass_cargo_3`, `e_cidade`, `e_ass_img`, `e_background`, `e_templat`, `e_location`) VALUES
(1, '70 anos do Curso de Biblioteconomia da UFRGS', '2017-12-05', '2017-12-05', 0, 'Declaro, para os devidos fins, que <b>$nome</b> participou da palestra proferida pela <b>Profa. Dra. Marisa Brascher Basilio Medeiros</b> intitulada \"Panorama da Pós-Graduação em Ciência da Informação no Brasil: oportunidades de formação e pesquisa\" e das atividades dos 70 anos do Curso de Biblioteconomia da UFRGS dia 05 de dezembro de 2017, no horário das 09h às 12h no Auditório 1 da FABICO/UFRGS, totalizando três horas.', '2017-12-05', 'Rita do Carmo F. Laipelt', 'Coordenadora da Comgrad de Biblioteconomia/UFRGS', '', '', '', '', 'Porto Alegre', 'img/certificado/ass_rita.jpg', 'img/certificado/cert_biblio_003.jpg', 1, NULL),
(2, '70 anos do Curso de Biblioteconomia da UFRGS - Comissão Organizadora', '2017-12-05', '2017-12-05', 0, 'Certificamos que a <b>$nome</b> participou como membro da Comissão Organizadora, atuando nas Comissões de Secretaria e Infraestrutura das atividades dos 70 anos do Curso de Biblioteconomia da UFRGS, realizado no dia 05 de dezembro de 2017, no horário das 09h às 12h no Auditório 1 da FABICO/UFRGS da Universidade Federal do Rio Grande do Sul, campus Saúde, em Porto Alegre, RS, com carga horária de 15 horas.', '2017-12-05', 'Rita do Carmo F. Laipelt', 'Coordenadora da Comgrad de Biblioteconomia/UFRGS', '', '', '', '', 'Porto Alegre', 'img/certificado/ass_rita.jpg', 'img/certificado/cert_biblio_003.jpg', 1, NULL),
(3, 'Dia do Bibliotecário (2018)', '2018-03-12', '2018-03-12', 0, 'Declaro, para os devidos fins, que <b>$nome</b> participou das comemorações do Dia do Bibliotecário promovida em parceria pelo Conselho Regional de Biblioteconomia da 10º Região (CRB10), a Associação Rio-Grandense de Bibliotecários (ARB) e o curso de Biblioteconomia da UFRGS. Como atividade do evento foi proferida a palestra pela bibliotecária Luciana Kramer, presidente do CRB10, e Bibliotecários Alexandre Demétrio, presidente da ARB sobre os Órgãos de Classe. Fizeram parte das atividades a mesa redonda “Bibliotecários em diversos espaços”.  O evento ocorreu no dia 12 de março de 2018, no horário das 09h às 12h no Auditório 1 da FABICO/UFRGS, totalizando três horas.', '2018-03-12', '', '', 'Alexandre Demétrio', 'Presidente da ARB', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_crb_001.jpg', 2, NULL),
(4, '09h00 - FEISC - Lancamento de Repositório Institucional da Extensão Rural Gaúcha - Emater-RS/Ascar', '2018-11-08', '2018-11-08', 0, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 1º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento foi proferida a palestra “A Mulher na Extensão Rural do RS” pela extensionista aposentada Odelta Ramires Quadros e lançamento do Repositório Institucional da Extensão Rural Gaúcha.  O evento ocorreu no dia 08 de novembro de 2018, no horário das 09h às 12h no Auditório 2 da FABICO/UFRGS, totalizando três horas.', '2018-11-08', 'Ana Maria Mielniczuk de Moura', 'Coordenadora do Programa de Pós-Graduação em Ciência da Informação da UFRGS', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin.jpg', 1, NULL),
(5, '14h00 - FEISC - Oficina de Projetos (14h00-17h00)', '2018-11-08', '2018-11-08', 0, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 1º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento participou da Oficina de Projetos de Pesquisa, coordenada pelos professores Jackson da Silva Medeiros e Sônia Elisa Caregnato.  O evento ocorreu no dia 08 de novembro de 2018, no horário das 14h às 17h no Auditório 2 da FABICO/UFRGS, totalizando três horas.', '2018-11-08', 'Ana Maria Mielniczuk de Moura', 'Coordenadora do Programa de Pós-Graduação em Ciência da Informação da UFRGS', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin.jpg', 1, NULL),
(6, '09h00 - FEISC - Lançamento do PPGCIN e do Edital de Seleção 2019/1 - Apresentação dos projetos de Pesquisa e Palestra', '2018-11-09', '2018-10-09', 0, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 1º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento foi proferida a palestra “Curadoria de informação na Wikipédia: lições para a comunicação científica” pelo Prof. Dr. Vinicius Medina Kern e lançamento oficial do Programa de Pós-Graduação em Ciência da Informação da UFRGS.  O evento ocorreu no dia 09 de novembro de 2018, no horário das 09h às 12h no Auditório 2 da FABICO/UFRGS, totalizando três horas.', '2018-11-09', 'Ana Maria Mielniczuk de Moura', 'Coordenadora do Programa de Pós-Graduação em Ciência da Informação da UFRGS', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin.jpg', 1, NULL),
(8, '3º FEISC - Palestra Birger Hjlornad - 10h00 - 29/10/2020', '2020-10-29', '2020-10-29', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 3º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento foi proferida a palestra “Concepts and Conceptual Relations: the basis and basics of Knowledge Organization Systems” pelo Professor Birger Hjørland.  O evento ocorreu no dia 29 de outubro de 2020, online, no horário das 10h às 12h, totalizando duas horas.', '2020-10-29', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 3, ''),
(7, '2º Fórum de Estudos em Informação, Sociedade e Ciência', '2019-08-23', '2019-08-23', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 2º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento foi proferida a palestra “[PÓS]VERDADE, INFORMAÇÃO E MEMÓRIA” pela Professora Vera Lucia Doyle Louzada de Mattos Dodebei.  O evento ocorreu no dia 23 de agosto de 2019, no horário das 09h às 12h no Auditório 1 da FABICO/UFRGS, totalizando três horas.', '2019-08-23', 'Prof. Dr. Rodrigo Silva Caxias de Sousa', 'Presidente do 2º FEISC', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin.jpg', 1, NULL),
(9, '3º FEISC - Palestra Benildes C. M. S. Maculan - 10h30 - 30/10/2020', '2020-10-30', '2020-10-30', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou do 2º Fórum de Estudos em Informação, Sociedade e Ciência. Como atividade do evento foi proferida a palestra “Representação da Informação Social e Cultural em Linguagens documentárias” pela Professora Benildes Coura Moreira dos Santos Maculan.  O evento ocorreu no dia 30 de outubro de 2020, online, no horário das 10h30 às 12h30, totalizando duas horas.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 1, ''),
(10, '3º FEISC - Apresentação Oral de Trabalhos', '2020-10-29', '2020-10-30', 1, 'Declaro, para os devidos fins, que <b>$nome</b> apresentou o trabalho \"$titulo\", com autoria de \"$autores\", na modalidade Comunicação Oral no 3º Fórum de Estudos em Informação, Sociedade e Ciência, realizado online no período de 29 e 30 de outubro de 2020.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 1, ''),
(11, 'PPGCIN - 2020/11/17 - Palestra Henriette Ferreira Gomes', '2020-10-29', '2020-10-29', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou da palestra \"Mediação da informação e suas dimensões: fundamento da atuação orgânica” ministrado pela Professora Henriette Ferreira Gomes.  O evento ocorreu no dia 17 de novembro de  2020, online, no horário das 19h às 21h, totalizando duas horas.', '2020-10-29', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin_thiago.jpg', 1, ''),
(12, 'PPGCIN - 2020/11/24 - Marcos Miranda', '2020-11-24', '2020-11-24', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou da palestra \"A Organização do Conhecimento em Religiões: uma abordagem aos estudos culturais nos sistemas de organização do conhecimento” ministrado pelo Professor Marcos Miranda.  O evento ocorreu no dia 24 de novembro de  2020, online, no horário das 19h às 21h, totalizando duas horas.', '2020-11-24', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/cert_ppgcin_thiago.jpg', 1, ''),
(18, 'PPGCIN - 2020/12/10 - Claúdia Grácio', '2020-12-10', '2020-12-10', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou da palestra \"Análises relacionais de citação como método para identificação de domínios científicos” ministrado pela Professora Maria Cláudia Cabrini Grácio.  O evento ocorreu no dia 10 de dezembro de  2020, online, no horário das 19h às 21h, totalizando duas horas.', '2020-12-10', '', '', '', '', '', '', 'Porto Alegre', '', 'img/certificado/cert_ppgcin_thiago.jpg', 1, ''),
(13, '3º FEISC - Apresentação de trabalhos 30/10/2020 - Ouvinte', '2020-10-30', '2020-10-30', 1, 'Declaramos, para os devidos fins, que <b>$nome</b> participou do 3º Fórum de Estudos em Informação, Sociedade e Ciência, na condição de ouvunte da seção de trabalhos orais. A seção ocorreu online no dia 30 de outubro de 2020 das 14h00 as 16h00, totalizando duas horas.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 1, ''),
(14, '3º FEISC - Apresentação de trabalhos 29/10/2020 - Ouvinte', '2020-10-29', '2020-10-29', 1, 'Declaramos, para os devidos fins, que <b>$nome</b> participou do 3º Fórum de Estudos em Informação, Sociedade e Ciência, na condição de ouvunte da seção de trabalhos orais. A seção ocorreu online no dia 29 de outubro de 2020 das 14h00 as 17h00, totalizando três horas.', '2020-10-29', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 1, ''),
(15, '3º FEISC - Avaliadores', '2020-10-29', '2020-10-29', 1, 'Declaramos, para os devidos fins, que <b>$nome</b> participou do 3º Fórum de Estudos em Informação, Sociedade e Ciência na condição de avaliador científico. O evento ocorreu no dia 29 e 30 de outubro de 2020.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', 'img/certificado/nd.jpg', 'img/certificado/feisc3_modelo01.jpg', 1, ''),
(16, '3º FEISC - Comissão Organizadora (RENE)', '2020-10-29', '2020-10-30', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou na condição de organizador do 3º Fórum de Estudos em Informação, Sociedade e Ciência. O evento ocorreu nos dia 29 e 30 de outubro de 2020, online, com palestrantes nacionais e internacionais e apresentação de trabalhos.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', '', 'img/certificado/feisc3_modelo02.jpg', 2, ''),
(17, '3º FEISC - Comissão Organizadora (THIAGO)', '2020-10-29', '2020-10-30', 1, 'Declaro, para os devidos fins, que <b>$nome</b> participou na condição de organizador do 3º Fórum de Estudos em Informação, Sociedade e Ciência. O evento ocorreu nos dia 29 e 30 de outubro de 2020, online, com palestrantes nacionais e internacionais e apresentação de trabalhos.', '2020-10-30', '', '', '', '', '', '', 'Porto Alegre', '', 'img/certificado/feisc3_modelo03.jpg', 1, '');
