(166, 176, '2017-11-22 12:38:04', 1, 'Contato', 'Discente contata secretaria e é encaminhado a Comgrad. Está com problemas pessoais (dificuldade financeira e de moradia). Está tendo acompanhamento da PRAE para resolver questão da moradia, faz acompanhamento psicológico na Clínica da UFRGS e tem contato com a assistente social de lá. Está conversando com professores para flexibilizar avaliações, pois não está conseguindo se dedicar às disciplinas. Conversou com dois professores e irá entrar em contato com mais duas. Investigo sua rede de apoio e oriento a entrar em contato com a Comgrad caso tenha alguma dificuldade em negociar com os professores.\r\n\r\nGiovana.', 0);
