INSERT INTO `prerequisito` (`id_pr`, `pr_estudante`, `pr_disciplina_1`, `pr_disciplina_2`, `pr_data`, `pr_justificativa`, `pr_status`, `pr_avaliacao`, `pr_parecer`, `pr_email`, `pr_parecer_data`) VALUES
(1, '00221944', 'BIB03337', 'BIB03225', '2018-02-01 17:59:49', 'No próximo semestre pretendo cursar as duas disciplinas que constam acima. Conversei com a Profa. Maria do Rocio e a mesma está de acordo e não há perda de conteúdo dessa forma.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', 'laubrandolt@gmail.com', '2018-02-01'),
(2, '00214992', 'ESTÁGIO', 'ELETI04', '2018-02-01 20:13:01', 'Solicito a quebra de pré-requisito para que possa me forma com 1 semestre de antecedência.', 9, 0, 'A aluna não precisa de quebra de pré-requisito, solicitação foi cancelada.', '', '2018-02-01'),
(3, '00261510', 'ESTÁGIO', 'ELETI08', '2018-02-01 20:24:02', 'conclui todas as disciplinas necessárias para ingressar no sétimo semestre, e gostaria de fazer o estágio curricular obrigatório. Porém tenho até o momento 12 créditos eletivos. Peço então a quebra de pré-requisito de 20 créditos para o estágio obrigatório.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(4, '00242183', 'ESTÁGIO', 'NAOAPLICA', '2018-02-01 20:51:19', 'Solicito a quebra de pré-requisito par as disciplinas acima mencionadas, pois esse semestre poderei fazer somente duas obrigatórias e o restante das eletivas. Gostaria de cursar o quanto antes, pois de acordo com o semestre que entre 2014/2, deveria realizar a formatura ainda esse ano.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-07'),
(5, '00242156', 'TCC', 'ESTÁGIO', '2018-02-01 20:59:53', 'Para concluir a graduação ainda em 2018/1 pretende-se cursar as duas disciplinas juntas.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(6, '00185232', 'ESTÁGIO', 'TCC', '2018-02-01 21:04:01', 'solicito a quebra  tendo em vista que não pude realizar em 2017/2 o estágio curricular, renovei com o TCE e tendo conhecimento da lei de estágio em vigor, negociei com eles o número de horas entre estágio não obrigatório e obrigatório e não obtive uma resposta satisfatória que me permitisse conciliá-los', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(7, '00194751', 'OBRIGAT', 'BIB03345', '2018-02-01 21:07:40', 'O semestre 2018/1 é meu último semestre dentro da possibilidade dos 16 semestres matriculas.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(8, '00194751', 'OBRIGAT', 'BIB03346', '2018-02-01 21:08:15', 'O semestre 2018/1 é meu último semestre dentro da possibilidade dos 16 semestres matriculas.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(9, '00229849', 'BIB03346', 'TCC', '2018-02-01 21:11:14', 'Necessito da quebra de pré-requisito para poder me matricular no TCC, já conclu[i a disciplina de Pesquisa em Ciência da Informação e possuo todos os créditos obrigatórios exceto o estágio curricular, então no próximo semestre necessito fazer o estágio e o tcc.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-01'),
(10, '00261503', 'ELETI06', 'BIB03345', '2018-02-01 21:13:58', 'Solicito a quebra de pré-requisito da carga eletiva faltante para dar continuidade ao curso de biblioteconomia.', 9, 0, 'Solicitação cancelada, a estudante já pode se matricular na disciplina solicitada.', '', '2018-02-01'),
(11, '00220289', 'ELETI10', 'BIB03346', '2018-02-01 21:16:15', 'Faltam nove créditos eletivos para os quais solicitarei aproveitamento de disciplinas já cursadas no IPA.', 5, 0, 'Prezada Camila,\r\n\r\npreciso que você venha conversar com a Comgrad para podermos compreender melhore seu planejamento do curso.\r\n\r\nPara nos consta que ainda faltam 19 créditos eletivos para finalizar.\r\n\r\nAguardamos você', '', '2018-02-01'),
(12, '00237543', 'ELETI04', 'BIB03345', '2018-02-05 18:38:44', 'Solicito quebra de pré-requisito das cargas eletivas para dar continuidade ao curso e finalizá-lo ainda este ano (2018/2). Peço a gentileza tendo em vista que tenho boas notas e um bom ordenamento, sem nunca ter sido reprovada em nenhuma matéria. Acredito que posso passar para a próxima etapa.', 2, 0, 'Prezada Pricila, acreditamos que você solicitou de forma incorreta a quebra de pré-requisito. Você já tem o direito de se matricular na disciplina de pesquisa. Entretanto o a disciplina de ESTÁGIO CURRICULAR OBRIGATÓRIO - BIB é que necessita de 20 créditos eletivos. Vendo seu erro, liberamos a disciplina de estágio.', '', '2018-02-05'),
(13, '00242176', 'ELETI05', 'ESTÁGIO', '2018-02-05 19:02:39', 'Boas notas na disciplina e caso o requisito não seja quebrado, amplia a permanência de mais um ano da instituição.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-05'),
(14, '00261505', 'ELETI04', 'ESTÁGIO', '2018-02-05 19:06:12', 'boas notas nas disciplinas cursadas até então, permanência de mais um ano na graduação caso o requisito não seja quebrado.', 1, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-05'),
(15, '00017883', 'BIB03338', 'BIB03341', '2018-02-05 19:36:16', 'Poder finalizar e cursar mais de uma disciplina no curso.\r\n', 5, 0, 'Prezado Edison,\r\n\r\npreciso que você entre em contato com a Comgrab para que possamos analisar seu caso e realizar um planejamento de suas disciplinas.\r\n\r\nSds,\r\nProf. Rene', '', '2018-02-06'),
(16, '00226069', 'ESTÁGIO', 'TCC', '2018-02-06 15:47:38', 'Aguardando conceito da disciplina de estágio.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-06'),
(17, '00180880', 'ESTÁGIO', 'TCC', '2018-02-06 17:28:01', 'Falta lançar as notas no sistema.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-06'),
(18, '00180876', 'ESTÁGIO', 'TCC', '2018-02-06 17:42:37', 'Falta lançar conceito no sistema.', 1, 0, 'A Comgrad/BIB em reunião extraordinária no dia 01/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-06'),
(19, '00277565', 'OBRIGAT', 'BIB03343', '2018-02-06 18:47:53', 'Prof. Jackson aceitou, pois considerou não haver prejuízos, e eu tenho a possibilidade de fazer 2 cadernos com ele no mesmo dia, me poupa tempo e dinheiro (passagens).', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 06/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-06'),
(20, '00242162', 'ESTÁGIO', 'TCC', '2018-02-07 11:53:36', 'Falta lança a nota do estágio.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 06/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-07'),
(21, '00277565', 'BIB03016', 'BIB03079', '2018-02-07 12:41:46', 'Pareamento do período, disciplina atrasada.', 2, 0, 'A Comgrad/BIB em reunião extraordinária no dia 06/02/2018 defere a solicitação de quebra de pré-requisito das disciplinas acima discriminadas.\r\n\r\nEstado o estudante apto a realizar a matrícula.', '', '2018-02-07'),
(22, '00219813', 'BIB03023', 'BIB03023', '2019-01-18 13:31:47', 'Gostaria muito de fazer a disciplina de Pesquisa para não me atrasar para poder me formar.', 3, 0, 'A solicitação foi indeferida, tendo em vista que os conteúdos das disciplinas a serem curadas são necessários para a sua realização.', '', '2019-01-18'),
(23, '00132872', 'BIB03340', 'BIB03023', '2019-01-18 13:37:04', 'Eu gostaria de adiantar essa disciplina para não me atrasar mais ainda no curso.', 3, 0, 'A solicitação da aluna foi indeferida tendo em vista que o conteúdo da disciplina de Estudos de Usuários é necessário para a realização da Pesquisa e desenvolvimento de coleções.', '', '2019-01-18'),
(24, '00208984', 'BIB03361', 'BIB03343', '2019-01-18 13:43:23', 'Tendo em vista a reformulação do currículo do curso de Biblioteconomia que altera o período a ser cursada a disciplina e considerando os conhecimento na área adquiridos pela requerente através de sua formação no curso técnico em Biblioteconomia, solicita a quebra de pré-requisito para que a disciplina de código BIB03343 seja cursada no semestre 2019/1.', 3, 0, 'A solicitação da aluna foi indeferida tendo em vista que a disciplina solicitada não é pré-requisito para as demais disciplinas do curso. O argumento apresentado pela aluna não justifica a necessidade de quebra de pré-requisito.', '', '2019-01-18'),
(25, '00221944', 'OBRIGAT', 'TCC', '2019-01-18 13:50:36', 'Com a atual mudança de currículo já possuo os créditos obrigatórios e eletivos exigidos para a realização das disciplinas de estágio I e seminário I. Pretendo me formar no próximo semestre, porém ainda tenho uma disciplina obrigatória pendente que corresponde a estes 4 créditos obrigatórios que me faltam para a realização das disciplinas referidas, correspondentes ao 8º semestre do curso.\r\nA disciplina que possuo pendente (Serviço de referencia e informação) será realizado no próximo semestre. E quanto a necessidade dos conhecimentos teóricos da mesma, gostaria de ressaltar que possuo conhecimento tanto de SRIP quanto de SRIV e que ao longo da minha trajetória acadêmica, já trabalhei em 5 unidades de informação e realizei SEI ou atendimento ao usuário em todas elas.', 2, 0, 'De acordo.', '', '2019-01-18'),
(26, '00221944', 'OBRIGAT', 'ESTÁGIO2', '2019-01-18 13:54:09', 'Com a atual mudança de currículo já possuo os créditos obrigatórios e eletivos exigidos para a realização das disciplinas de estágio I e seminário I. Pretendo me formar no próximo semestre, porém ainda tenho uma disciplina obrigatória pendente que corresponde a estes 4 créditos obrigatórios que me faltam para a realização das disciplinas referidas, correspondentes ao 8º semestre do curso.\r\nA disciplina que possuo pendente (Serviço de referencia e informação) será realizado no próximo semestre. E quanto a necessidade dos conhecimentos teóricos da mesma, gostaria de ressaltar que possuo conhecimento tanto de SRIP quanto de SRIV e que ao longo da minha trajetória acadêmica, já trabalhei em 5 unidades de informação e realizei SEI ou atendimento ao usuário em todas elas.', 2, 0, 'De acordo.', '', '2019-01-18'),
(27, '00221944', 'OBRIGAT', 'BIB03370', '2019-01-18 13:54:32', 'Com a atual mudança de currículo já possuo os créditos obrigatórios e eletivos exigidos para a realização das disciplinas de estágio I e seminário I. Pretendo me formar no próximo semestre, porém ainda tenho uma disciplina obrigatória pendente que corresponde a estes 4 créditos obrigatórios que me faltam para a realização das disciplinas referidas, correspondentes ao 8º semestre do curso.\r\nA disciplina que possuo pendente (Serviço de referencia e informação) será realizado no próximo semestre. E quanto a necessidade dos conhecimentos teóricos da mesma, gostaria de ressaltar que possuo conhecimento tanto de SRIP quanto de SRIV e que ao longo da minha trajetória acadêmica, já trabalhei em 5 unidades de informação e realizei SEI ou atendimento ao usuário em todas elas.', 1, 0, 'De acordo.', '', '2019-01-18'),
(28, '00193242', 'MAT02280', 'BIB03369', '2019-01-18 14:06:16', 'No momento do meu ingresso no curso de Doutorado no Programa de Pós-Graduação em Educaç~~ao da UFRGS, solicitei a comissão avaliadora de ingresso e de bolsa que pudesse concluir o curso de Biblioteconomia, tendo sido posta a condição de que fizesse no menor tempo possível. Iniciei o doutorado em agosto de 2018, e durante o segundo semestre de referido ano, me dediquei a finalizar as disciplinas eletivas restantes da Biblioteconomia, bem como as obrigatórias que antecedem o estágio. Apenas ficou faltando a disciplina de estatística, que através do presente documento, solicito a quebra de pré-requisito.', 2, 0, 'Deferido.', '', '2019-01-18'),
(29, '00193242', 'MAT02280', 'ESTÁGIO1', '2019-01-18 14:06:30', 'No momento do meu ingresso no curso de Doutorado no Programa de Pós-Graduação em Educaç~~ao da UFRGS, solicitei a comissão avaliadora de ingresso e de bolsa que pudesse concluir o curso de Biblioteconomia, tendo sido posta a condição de que fizesse no menor tempo possível. Iniciei o doutorado em agosto de 2018, e durante o segundo semestre de referido ano, me dediquei a finalizar as disciplinas eletivas restantes da Biblioteconomia, bem como as obrigatórias que antecedem o estágio. Apenas ficou faltando a disciplina de estatística, que através do presente documento, solicito a quebra de pré-requisito.', 2, 0, 'Deferido.', '', '2019-01-18'),
(30, '00193242', 'MAT02280', 'BIB03370', '2019-01-18 14:06:50', 'No momento do meu ingresso no curso de Doutorado no Programa de Pós-Graduação em Educaç~~ao da UFRGS, solicitei a comissão avaliadora de ingresso e de bolsa que pudesse concluir o curso de Biblioteconomia, tendo sido posta a condição de que fizesse no menor tempo possível. Iniciei o doutorado em agosto de 2018, e durante o segundo semestre de referido ano, me dediquei a finalizar as disciplinas eletivas restantes da Biblioteconomia, bem como as obrigatórias que antecedem o estágio. Apenas ficou faltando a disciplina de estatística, que através do presente documento, solicito a quebra de pré-requisito.', 2, 0, 'Deferido.', '', '2019-01-18'),
(31, '00193242', 'MAT02280', 'ESTÁGIO2', '2019-01-18 14:07:12', 'No momento do meu ingresso no curso de Doutorado no Programa de Pós-Graduação em Educaç~~ao da UFRGS, solicitei a comissão avaliadora de ingresso e de bolsa que pudesse concluir o curso de Biblioteconomia, tendo sido posta a condição de que fizesse no menor tempo possível. Iniciei o doutorado em agosto de 2018, e durante o segundo semestre de referido ano, me dediquei a finalizar as disciplinas eletivas restantes da Biblioteconomia, bem como as obrigatórias que antecedem o estágio. Apenas ficou faltando a disciplina de estatística, que através do presente documento, solicito a quebra de pré-requisito.', 2, 0, 'Deferido.', '', '2019-01-18'),
(32, '00193242', 'OBRIGAT', 'BIB03345', '2019-01-18 14:08:13', 'No momento do meu ingresso no curso de Doutorado no Programa de Pós-Graduação em Educaç~~ao da UFRGS, solicitei a comissão avaliadora de ingresso e de bolsa que pudesse concluir o curso de Biblioteconomia, tendo sido posta a condição de que fizesse no menor tempo possível. Iniciei o doutorado em agosto de 2018, e durante o segundo semestre de referido ano, me dediquei a finalizar as disciplinas eletivas restantes da Biblioteconomia, bem como as obrigatórias que antecedem o estágio. Apenas ficou faltando a disciplina de estatística, que através do presente documento, solicito a quebra de pré-requisito.', 2, 0, 'Deferido.', '', '2019-01-18'),
(33, '00156945', 'ESTÁGIO1', 'ESTÁGIO2', '2019-01-18 14:18:21', 'Tendo como justificativa a troca do currículo do curso, que afetou meu planejamento de estudos e fim da graduação. Meu estágio curricular sendo executando em 210 horas, com início em fevereiro, e pretendo me formar no meio do ano.', 2, 0, 'A aluna já tem créditos suficientes para cursar o estágio obrigatório II', '', '2019-01-18'),
(34, '00156945', 'ESTÁGIO1', 'BIB03370', '2019-01-18 14:18:32', 'Tendo como justificativa a troca do currículo do curso, que afetou meu planejamento de estudos e fim da graduação. Meu estágio curricular sendo executando em 210 horas, com início em fevereiro, e pretendo me formar no meio do ano.', 2, 0, 'A aluna já tem créditos suficientes para cursar BIB03370 - SEMINÁRIO DE PRÁTICA DE ESTÁGIO II', '', '2019-01-18'),
(35, '00156945', 'OBRIGAT', 'TCC', '2019-01-18 14:18:50', 'Tendo como justificativa a troca do currículo do curso, que afetou meu planejamento de estudos e fim da graduação. Meu estágio curricular sendo executando em 210 horas, com início em fevereiro, e pretendo me formar no meio do ano.', 2, 0, 'De acordo.', '', '2019-01-18'),
(36, '00198158', 'OBRIGAT', 'BIB03345', '2019-01-21 16:36:34', 'Venho por meio deste formulário, solicitar quebra de pré-requisito para realizar a disciplina de Pesquisa no semestre 2019/1, pois já estou com 104 créditos obrigatórios integralizados, 30 créditos em disciplinas eletivas e todas as atividades complementares realizadas. No referido semestre vou cursar a única disciplina obrigatória que falta (BIB03343 - Ética da Informação) e tenho tempo, bem como plenas condições, para a realização da referida disciplina', 2, 0, 'Comgrad de acordo com a quebra de pré-requisito, com recomendação para que se matricule também nas disciplinas de seminário e estágio curricular obrigatório.\r\n\r\n- ESTÁGIO CURRICULAR OBRIGATÓRIO I\r\n- SEMINÁRIO DE PRÁTICA DE ESTÁGIO I (BIB03369)', '', '2019-01-21'),
(37, '00233675', 'BIB03345', 'TCC', '2019-01-29 14:57:13', 'Solicito a quebra de pré-requisito com o intuito de antecipar minha colação de grau no curso de Biblioteconomia da UFRGS, para o semestre de 2019/1, visto que, possuo quase a totalização dos créditos necessários para tal. Ademais, realizei o estágio curricular obrigatório com carga de 210 horas sendo aprovada no semestre 2018/2.', 9, 0, 'Cursar concomitantemente as disciplinas de Projeto de Pesquisa e TCC requer uma amadurecimento do problema de pesquisa. Favor informar qual o orientador do TCC e se ele está de acordo com a possibilidade de cursar as duas disciplinas juntas.\r\n** CANCELADO A PEDIDO DO ALUNO **', '', '2019-02-03'),
(38, '00277569', 'OBRIGAT', 'BIB03345', '2019-02-01 13:22:25', 'Com a liberação desse pré-requisito poderei concluir o curso em 4 anos.', 2, 0, 'Em análise do curriculo da estudante, e das possibilidades de matricula para 2019/1, defere-se as solicitações de quebra de pré-requisito, com liberação para as disciplinas:\r\nESTÁGIO CURRICULAR OBRIGATÓRIO I; PESQUISA EM BIBLIOTECONOMIA E CIÊNCIA DA INFORMAÇÃO (BIB03345); SEMINÁRIO DE PRÁTICA DE ESTÁGIO I (BIB03369)', '', '2019-02-01'),
(39, '00229443', 'MAT02280', 'BIB03345', '2019-02-01 13:31:39', 'Justifico que a quebra de pré-requisito é necessária para que possa concluir o curso de graduação no tempo previsto, tendo em vista que faltam apenas duas disciplinas obrigatórias faltantes de forma a não prejudicar meu desempenho no semestre vindouro.', 3, 0, 'Existe a preocupação com grande número de atividades a serem cursas em 2019. E devido ao número de reprovação por FF (duas no semestre anterior) e um reprovação por nota (D). Ressalta-se também que a disciplina de Sistemas de Classificação IV fazer parte do núcleo da Biblioteconomia, sendo conteúdo importante para o desenvolvimento do Projeto e do Estágio Obrigatório. Indefere a solicitação da estudante.', '', '2019-02-01'),
(40, '00171184', 'MAT02280', 'BIB03345', '2019-02-05 14:46:01', 'Falta a cadeira de estatística para liberação.', 2, 0, 'De acordo', '', '2019-02-05');
